(15, '2019-02-02 00:00:00', '2018-02-02 00:00:00', '2019-02-10 00:00:00', 0, NULL, NULL, 49, 40, NULL, 3, 15, 1, NULL, 1, 1, 1, 7, 'Hombre de 70 años de edad que ingresa por cuadro de desorientación.', 'PERSONALES: Sin alergias conocidas. HTA. \nMedicación habitual: Procrin trimestral. Nolotil cápsulas 2-1-2. Ibuprofeno 600 mg al día. Cardurán 8 mg noche.\nHistoria oncológica familiar: madre diagnosticada de cáncer de colon con 70 años.\nHISTORIA ONCOLÓGICA: Diagnosticado de un adenocarcinoma prostático grado 9 de Gleason (4+5) con infiltración de glándula seminal derecha con PSA desconocido en diciembre de 2008. Ante paciente con adenocarcinoma de próstata localmente avanzado se inició tratamiento con Procrin y Casodex.\n- Rastreo óseo en febrero de 2009 con acúmulos en L3 e isquion izquierdo y un PSA 1. Sigue en controles en Urología hasta julio de 2009 donde aparece en TR con masa por encima de la próstata. Se solicita: - RMN donde se observa tumoración pélvica de carácter polipoideo vegetante que asienta en la encrucijada entre el lóbulo prostático izquierdo, vesicula seminal izquierda y cara anterior del recto, de aspecto sólido, con necrosis central, de 7,2 x 6,3 x 6,6 cm que infiltra la fascia y el mesorrecto en su vertiente anterior, comprime en el recto pudiendo sobrepasar la muscular y la mucosa. En su contacto con la fascia lateral pélvica izquierda la cual se encuentra asimismo infiltrada. - CEA 2.1, PSA 38.4\nSe retiró Casodex sin presentar ninguna mejoría de la clínica.\nAnte paciente con carcinoma de próstata localmente avanzado y hormonorresistente se decide iniciar tratamiento con quimioterapia TAXOTERE 75mg/m2/IV cada 21 días. Tras 6 ciclos de QT en el TAC presenta aumento en la masa prostática, con aumento de la sintomatología a nivel rectal y aparición de metástasis hepática.\nActualmente en tratamiento con Taxol (tres ciclos).', 'Presenta episodios de desorientación desde hace varios días coincidiendo con el aumento de dosis de oxycontin, acompañado de una disminución de la ingesta hídrica.', 'Paciente con REG, consciente, desorientado en tiempo. Normohidratado y coloreado.\nPares craneales simétricos y conservados. Fuerza 5/5 en todos los miembros. No alteraciones de la marcha. Pupilas mióticas, poco reactivas.\nAC/R sin hallazgos.\nAbdomen: blando y depresible, difusamente doloroso, sobre todo en hipogastrio. Moderados edemas tibiomaleolares.\n\nPROVES COMPLEMENTÀRIES / PRUEBAS COMPLEMENTARIAS\nHEMOGRAMA: (02/12/2010): Leucocitos: 7400 / mm³. Neutrófilos: 6400%. Hemoglobina: 11.1 g/dl. Plaquetas: 323000 / mm³.\nBIOQUÍMICA: Urea 81/mg/dl. Creatinina: 2.13 mg/dl.\nTAC craneal: sin hallazgos significativos\nEco renal: Ureterohidronefrosis grado II-III bilateral. Ambos riñones de tamaño normal. Vejiga a media replección con material ecogénico en la porción más declive. Masa sólida en pelvis de 11x10x12 cm que engloba próstata e infiltra la pared posteroinferior de la vejiga.', 'Tras el ingreso, se realiza sondaje uretral con presencia de hematuria abundante que requiere radioterapia hemostática para su control. Se realiza rotación opioide a fentanilo sc, mejorando el cuadro de desorientación y el dolor. Presenta un progresivo deterioro de la función renal y se plantea la colocación de un doble jota que no es efectivo y debe realizarse nuevamente función renal para conseguir una diuresis efectiva.\nSe da el alta al paciente con un aceptable estado general. Será controlado en domicilio por la Unidad de Hospitalización domiciliaria.', 'Adenocarcinoma de próstata.', 'Uropatía obstructiva.\nNeurotoxicidad opioide.', NULL, 'Meiact 400: 1 comp cada 12 horas.\nSeguril: 1 comp al dia.\nOmeprazol: 1 comp al dia.\nInfusor sc cada 24 horas con 1500 microgramos de Fentanest (10 amp).\nCarduran neo 4 mg: 1 comp por la noche.\nNeurontin 600: 1 comp cada 8 horas.\nFortecortin 4 mg: 1 comp en desayuno.\nSi dolor 1 cc de Fentanest sc (50 microgramos).', 'Meiact 400: 1 comp cada 12 horas.\nSeguril: 1 comp al dia.\nOmeprazol: 1 comp al dia.\nInfusor sc cada 24 horas con 1500 microgramos de Fentanest (10 amp).\nCarduran neo 4 mg: 1 comp por la noche.\nNeurontin 600: 1 comp cada 8 horas.\nFortecortin 4 mg: 1 comp en desayuno.\nSi dolor 1 cc de Fentanest sc (50 microgramos).', NULL),
(17, '2018-05-18 00:00:00', '2018-05-18 00:00:00', '2018-05-18 00:00:00', NULL, NULL, NULL, 51, 61, NULL, 5, 16, 6, NULL, 6, 1, 1, 40, 'REFIERE HABERSE REALIZADO UNA FARINGOPLASTIA (9/5/2018) Y AHORA NO LE PARA DE SANGRAR. AVISADO ORL.', NULL, 'Paciente de 42 años que acude por leve sangrado oral tras faringoplastia el 9/5/2018. \nReviso lecho quirúrgico observando coagulo en polo superior de lecho amigdalar izquierdo.\nHago hemostasia con torunda con amchafibrin sin presionar excesivamente (respetando suturas).\nCese de babeo hemático tras hemostasia.\nAlta. Si nuevo sangrado acudir a urgencias.', NULL, NULL, 'FARINGOPLASTIA', NULL, NULL, NULL, NULL, NULL),
(18, '2019-02-27 00:00:00', '2019-01-10 00:00:00', '2019-01-11 00:00:00', NULL, NULL, NULL, 68, 66, NULL, 5, 10, 6, NULL, 5, 1, 1, 45, 'Palpitaciones, cefalea, opresión a mínimos esfuerzos, sudoración', 'No RAM conocidas\nNo HTA DM DL\nNo hábitos tóxicos\nAsma con tratamientos de rescate\nBypass gástrico hace 7 años', 'Asma con tratamientos de rescate', 'TA: 140/80 mmHg  \nFC: 120lat/min  (Ríitmica) \nSat. O2: 99% (sin oxñigeno)\nBEG, afebril, levemente taquipneico al reposo, normohidratado, normocoloreado. no sudoroso\nAP: MVC, sin ruidos añadidos\nAC: Taquicardico  arítmica sin soplos, pulso sincronico\nAbdomen: RHA presentes, depresible sin dolor a la palpación\nMMII: móviles simétricos sin edema\nECG  FA con respuesta a 103lpm. No signos de isquemia aguda\nAnalítica de sangre normal\nRX Tórax AP: No objetivo alteraciones patolçogicas de interés', 'Consulto con cardiologia y les enseño el ECG. Indican que se pase al area de camas para monitorización, anticoagulación y reversión con flecainamida\nPautamos según recomentdaciones clexane 120mg + vernakalant\nFin de perfusión de Vernakalant 00.59h\nSe repite ECG. Fibrilación auricular a 86lpm. No alteraciones de la repolarización sugestivas de isquemia aguda\n9.30h se realiza CVE bajo sedación con buena respuesta y pasando a RS56 lpm\nMantiene Rs y establilidad en urgencias durante observación', 'FA', 'Cardioversión electrica', 'ECG\nAnalítica de sangre\nRX Torax AP', 'No precisa', 'No precisa', 'Control por médico de cabecera.\nRemitir a Cardiología de zona\nSi empeora, acuda a puerta de urgencias'),
(19, NULL, '2010-10-05 00:00:00', '2019-10-28 00:00:00', NULL, NULL, NULL, 1, 59, NULL, 4, 6, 1, NULL, 2, 1, 1, 38, 'DESCOMPENSACIÓN HIPERGLUCEMIA CETÓSICA', 'No RAM conocidas.\nNo hábitos tóxicos\nDiabetes Mellitus\n	*en tratamiento con ADOs\n	*de 2 años de evolución\n*No complicaciones agudas ni crónicas\n*mala control habitual HBA1c de abril de 2010 de 9.7%\n*Mi croalbumunuria en abril de 2010 de 35mg/l\nObesidad\nSíndrome ansioso depresivo\nAnemia microcítica desde hace 7 meses\nAmenorrea desde hace 7 meses (con ciclos de hipermenorrea)\nQx: Apendicectomía\nMedicación habitual: Glimepirida 1compr/vo / 24hrs, prevemiente ttº con Metformina x3, Tranxilium 50 1c/12h, Seroquel 100 1c/, Rivotril 2mg/des. Exertia 1compr/desayuno', 'Paciente aduce a MAP por cínica de poliuria, polidipsia, astenia y polifagia de 7 días de evolución sin pérdida de peso asociada. En MAP se objetica GD de 420 mg/dl, por lo que se remite a UMED. Refiere clínica similar desde hace 3 meses asociado al cambio de tratamiento antidiabético. Fue sustituida la metformina por posible intolerancia (molestias digestivas). Las clínica cardinal se ha agravado en los últimos 10 días. Refiere aumento de peso en los últimos 2 años de 15kg. Aumento de ingesta en los últimos 2 años. Refiere disminución de la actividad física habitual desde hace 6 meses, que atribuye a problema psiquiátrico y a astenia. No fiebre termoentrada, no clínica abdominal ni otra clínica infecciosa. Refiere hipermenorrea en los últimos 7 meses. No otros sangrado, ni carencias nutricionales. No toma Fe.', 'Buen estado general. NC. NH. Eupneica en reposo. Aapirética, TA 119/83 mmhg, Fc 88 Ipm. Sat 02 96% (Fi052: 0,21)\nAc: rítmia sin soplos ni roces\nAp: MVC no ruidos sobreañadidos\nAbdomen: blando, depresible. Ruidos hidroaéreos conservados no metálicos. No masas ni megalias. No dolor a la palpación, no pritonismo. Marcada obesidad abdominal.\nPulsos periféricos presentes y simétricos.\nNo edemas ni signos TVP\nExamen neurológico: consciente, orientada con lenguaje conservado. No alteraciones en pares craneales. Fuerza y sensibilidad conservada. No signos de focalidad neurológica. No alteración en sensibilidad superficial, grosera y térmica de ambos pies.\nNo bocio, ni adenopatías.', 'Se inicia tratamiento con insulinoterapia e hidratación. Se realiza interconsulta a Psiquiatría retirando los fármacos hiperglucemiantes. Se inicia tolerancia con metformina no siendo tolerada por la paciente. Se realiza educación diabetológica, iniciando tratamiento con insulina basal más sulfonilureas lográndose buen control metabólico. Dados los hallazgos descritos se decido alta hospitalaria con las recomendaciones abajo indicadas.', 'DESCOMPENSACIÓN HIPERGLUCÉMICA CETÓSICA', 'Anemia ferropénica\nSDR ansioso-depresivo\nObesidad\nMal control metabólico', NULL, NULL, 'Insulina Lantus Solostar 36ui en cena\nControl GD antes de desayuno, comida y cena\nAjuste de insulina según Glucemia antes de desayuno\n	150-200	36UI\n	201-250	38UI\n	251-300	40 UI\n	301-350	42UI\nDieta diabética 1500 kcal\nNovonorm 1mg/vo/8h\nFluoxetina 1compr/vo/8hrs\nRivotril 2 mg1-0-1\nTranxilium 50 mg 1c/12h\nSi síntomas de hipoglucemia (sudoración palpitaciones, mareo…)\n	*si conciencia conservada: ingesta de hidratos de carbono (azúcares, zumos, caramelos)\n	*si alteraciones conciencia: Administración de Glucagen Hipokit Nov más ingesta de carbohidratos.\nFerogradumet 1compr/vo/ en desayuno\nControl por MAP.', NULL),
(20, '2019-03-01 00:00:00', '2016-04-29 00:00:00', '2016-05-01 00:00:00', NULL, NULL, NULL, 12, 57, NULL, 3, 17, 4, NULL, 2, 1, 2, 36, 'CIRUGÍA PROGRAMADA', 'Pac masculino de 37 años con diagnóstico de H de Hiato. En 2010 comenzó con dolor epigástrico con RGE y se hizo una endoscopia viendo h de hiato tomando esomeprazol, desde entonces mantiene omeprazol de 20mg. El medicamento solo le mejora en parte y asociado a dieta. Presenta episodios de broncoaspiración nocturna y debe dormir de lado con el empeoramiento de su problema de espalda.', 'Pac masculino de 37 años con diagnóstico de H de Hiato. En 2010 comenzó con dolor epigástrico con RGE y se hizo una endoscopia viendo h de hiato tomando esomeprazol, desde entonces mantiene omeprazol de 20mg. El medicamento solo le mejora en parte y asociado a dieta. Presenta episodios de broncoaspiración nocturna y debe dormir de lado con el empeoramiento de su problema de espalda.', 'Obesidad\nAbdomen anodino', 'Postoperatorio sin complicaciones, reanudando tránsito digestivo y tolerancia oral, por lo que es alta por mejoría clínica.', 'HERNIA DE HIATO', 'BRONQUITIS AGUDA', 'ELECTROCARDIOGRAMA\nRADIOGRAFIA TORACICA RUTINARIA, DESCRITA COMO TAL', 'CAMARA INHALACION + MASCARILLA ADULTOS / 1 CAMARA INHALACION ( NO FINANCIABLE)\n\nFoster 100/6MCG/PULSAC 1 INHALADOR 120 DOSIS SOL INHAL ENVAS PRESION 2 PULSACION cada 12 horas aplicar con cámara espaciadora\n\nVENTOLIN C/6H TAMBIÉN EN CÁMARA ESPACIADORA \n\nCEFUROMAXIMA 500 MG c/12h', 'CAMARA INHALACION + MASCARILLA ADULTOS / 1 CAMARA INHALACION ( NO FINANCIABLE)\n\nFoster 100/6MCG/PULSAC 1 INHALADOR 120 DOSIS SOL INHAL ENVAS PRESION 2 PULSACION cada 12 horas aplicar con cámara espaciadora\n\nVENTOLIN C/6H TAMBIÉN EN CÁMARA ESPACIADORA \n\nCEFUROMAXIMA 500 MG c/12h', NULL),
(21, '2018-10-15 00:00:00', '2018-11-10 00:00:00', '2018-11-15 00:00:00', 0, NULL, NULL, 53, 45, NULL, 20, 1, 1, NULL, 6, 1, 1, 21, 'Mal estado general. Estudio síndrome mononucleósico.', 'Antecedentes familiares:\nPadre, 51 años, sano. Madre, 47 años, fiebre tifoidea a los 27 años, artralgias frecuentes. Cuatro embarazos, dos abortos, una muerte al nacimiento. Hermano de 23 años, sano.\nTía materna, policitemia vera. Abuelo materno, fiebre tifoidea.\n\nAntecedentes personales:\nEmbarazo: diabetes gestacional. Parto en La Fe a las 40 semanas, por cesárea. Perinatal normal. PN:4.100gr.\nIngresada en observación 24h. Desarrollo psicomotor normal. Correctamente vacunado. Antecedentes patológicos: otitis, amigdalitis recurrentes.', 'Enfermedad actual:\nNiña de 6 años y tres meses que acude de nuevo a urgencias por fiebre prolongada de 18 días. Visita en urgencias el día 01/11/00 por fiebre de 39ºC de 12 días de evolución, tratada con amoxicilina oral 8cc/8h.\nPresentaba tumefacción cervical bilateral 1.5x1.5 cm con amígdalas exudativas. Se realizó Monosticón que fue positivo y detección rápida S.pyogenes negativa. Se remitió con el diagnóstico de mononucleosis infecciosa, pendiente de confirmar positividad de VEB. Acude de nuevo por empeoramiento, aumento de las adenomegalias submandibulares con dolor, asocia cefalea, mantenimiento de la fiebre, cervicalgia y accesos de tos frecuente', 'Exploración al ingreso:\nPeso: 19.400 (p.75-90)     Talla: 109 cm (p.90-97)\nTª 38.5ºC    FC 120      FR 20\nRegular aspecto general, decaída, discreta palidez de piel, no de mucosas. \nAC: Tonos rítmicos sin soplos.\nAP: Ruidos de transmisión\nAbdomen blando y depresible sin masas ni megalias. No doloroso. Adenopatías de 3x3 cm bilaterales, laterocervicales.\n\nExploración complementaria:\n01/11/00\nHemograma: leucocitos 25.900 (N80%)\nPCR 49\nMonosticón positivo\nSerología virica: anti-CMV negativo, anti-VEB negativo\nDetección rápida S.pyogenes: negativo\nHemocultivo: S. epidermidis a las 48h (probable contaminación) Negativo a los 7 días.\n\n05/11/00\nHemograma: H 4.260.000, Hb 12.5, Hto.36.1, VCM 84.6, leucocitos 16.300 (L 18.4%, M11.2%,N 69%), PLAQUETAS 305.000\nPCR 17.3\nGPT 12\nHemostasia: TTPA 41, TP 13, Quick 96, INR 1, Fibrinógeno 620\nMantoux negativo\nRx tórax normal.\n\n08/11/00\nHemograma: H 3.680.000, Hb 10.5, Hto.30.2, VCM 82, leucocitos 24.500 (L14%, M6.4%,N78.2%),PLAQUETAS 312.000\nVSG 128\nReticulocitos 91.7 \nMorfología: leucocitosis con neutrofilia, gran refuerzo de la granulación citoplasmática. Monocitos con vacuolas en su citoplasma.\nS.Orina: normal\nBioquimica sangre: glucosa 82, urea 19, creatinina 0.5, ác.úrico 2.1, GOT 20,GPT15,Gamma GT 13, Bilirrubina normal,Proteínas totales 8.02, albúmina 3.46, iones normales\ninmunología; IgG 1360, IgA 460, IgM 522, ASLO 102, PCR 93.2\n\n\n\n13/11/00\nSerología vírica: anti-toxoplasma negativo, anti-CMV negativo, anti-herpes simplex negativo, anti-hepatitis A negativo, anti-Hepatitis B y C negativo\nHemograma: H3.890.000, Hb 11, Hto 31, VCM 81, leucocitos 13.500(L35%, M 10%, N 52%), P`laquetas: 547.000, VSG 121,reticulocitos 57.8\nMorfología: trombocitosis, monocitosis,resto normal\nCPK 67, LDH 442, GOT32, GPT31,  gamamGT 13\nFosfatasas alcalinas 3287 \nBilirrubina normal\nS. orina: normal\n\n16/11/00\nBioquímica sangre:  creatinina 0.5, aclaramiento creatinina 30.8,aclaramiento corregido: 68.5 ml/min/1.73m2 (con volumen de orina 270ml, dudosa recogida), aclaramiento creatinina según fórmula de Schwartz: 120 ml/min/1.73m2\nCalcio 9.4, fósforo 4.2, magnesio 2.4\nOrina de 24h: volumen remitido 270ml, creatinuria 221 mg, Calcio 20.3, fósforo 207.9', 'Evolución y tratamiento:\nTras ingreso permanece con fiebre que oscila alrededor de 38.5ºC, con regular estado general e inapetente. Se evidencian adenopatías subangulomandibulares de 4.5x3.5 cm (izquierda) y 1x1 cm (derecha), con algunas laterocervicales posiblemente antiguas.Presenta dolor cervical. Se pauta tratamiento analgésico y antipirético. Ante estreñimiento se pauta Emuliquen. Sigue inapetente y se instaura suplemento con Pentaplus. Persiste congestión de vías aéreas altas, con abundante mucosidad que días después se hace hemetizante. Ante la persistencia de la fiebre y hemograma con leucocitosis y neutrofilia, se inicia tratamiento con cefuroxima, comenzando después con alguna deposición líquida, que se atribuye al antibiótico. Al día siguiente presenta febrícula, que cede después, permaneciendo el resto de su estancia apirética.. Las adenopatías se reducen considerablemente de tamaño y ceden los síntomas respiratorios. Ante la buena evolución tras antibiótico se sospecha una sobreinfección bacteriana de vías respiratorias altas.\nEn analítica de control aparece elevación de fosfatasas alcalinas, por lo que se realiza edad ósea y control bioquímico, que se repetirá en consultas externas. Se da de alta con muy buen estado general, con exploración normal y adenopatías persistentes pequeñas no dolorosas.', 'SINDROME MONONUCLEOSICO', 'HIPERTROFIA ADENOIDEA CON ADENOIDITIS \nFARINGOAMIGDALITIS AGUDA\nGASTROENTERITIS AGUDA\nHIPERFOSFATASIA', NULL, '', NULL, 'Dieta astringente si diarrea'),
(22, '2019-01-15 00:00:00', '2019-01-10 00:00:00', '2019-01-15 00:00:00', NULL, NULL, NULL, 52, 43, NULL, 19, 17, 1, NULL, 6, 1, 1, NULL, 'Ingresa por endometriosis bilateral', 'No alergias. \nNo antecedentes médico-quirúrgicos de interés. \nFumadora habitual. \nEsterilidad primaria.', 'Consultó para revisión ginecológica y por polimenorreas. En estudio ecográfico se objetiva presencia de quiste anexial  derecho compatible con endometriosis, por lo que es remitida a consultas externas. En estudio ecográfico en consultas presenta quistes en ambos anexos ( de 4 y 3 cm) que sugieren endometriosis. Elevación del marcador CA 125. Tras estudios preoperatorios se programa intervención.', NULL, NULL, 'Endometriosis ovárica bilateral', 'Quiste anexial derecho\nFunador', 'Quistectomia Ovárica Bilateral\nLaparotomía\nEcografia', 'Cura local de herida con betadine o cristalmina.\nReposo relativo. Si T mayor de 38ºC acudir a urgencias.', 'Paracetamol 1g/8h V.O. máximo dolor', NULL),
(23, NULL, '2019-02-01 00:00:00', '2019-02-04 00:00:00', 0, NULL, NULL, 61, 41, NULL, 4, 2, 1, NULL, 6, 1, 1, 17, 'Mujer de 51 años que consulta por REACCIÓN ALÉRGICA.', 'No RAM.\nNo hábitos tóxicos.\nHTA, no DL, no DM.\nAlérgica a la humedad y los hongos.\nNiega enfermedades de interés.\nIQ: ninguna.\nTratamiento: enalapril 5 mg 1c/dia.', 'La paciente refiere que ha tomado actitiol por tos y sensación disneica (comenzó a tomarlo ayer). Ayer comenzó con angioedema en labios, que hoy se ha incrementado, asociando sensación disnéica y dificultad para la deglución, así como prurito en paladar y oídos.\nNO estridor inspiratorio.', 'Constantes: TA 148/94 mmhg, FC 94 lpm, SatO2 basal 100%.\nBuen nivel de consciencia, orientada en tiempo y espacio. Normohidratada y normocoloreada. Eupneica en reposo. Buen estado general.\nA.Cardíaca: tonos rítmicos, sin soplos.\nA.Pulmonar: MVC sin ruidos sobreañadidos.\nAbdomen blando y depresible, sin masas ni megalias ni puntos dolorosos a la palpación. No hay signos de irritación peritoneal. Auscultación abdominal: ruidos hidroaéreos conservados.\nMMII sin edemas. Pulsos periféricos presentes y simétricos. \nEdema de úvula y paladar, angioedema.\nEn sala de hospitalización.\nRR 14 ppm.\nApirética TA; 135/85 pulso 98 ppm regular.\nPulso saturación.\nO2 98% fiO2 0.21.\nAp buena ventilación.\nAC rítmica.\nAbdomen sin signos de irritación peritoneal.\nDiscreto edema en labio superior.', 'Se inicia terapéutica antihistamínicos asociando antibióticos y broncodilatadores con desaparición de edema por lo que se procede al alta hospitalaria.', 'REACCIÓN ALÉRGICA.', 'ANGIOEDEMA.\nFARINGITIS.', 'ECG.', '', 'Prescrito en MPRE:\nZAMENE 30MG 10 COMPRIMIDOS. 1 COMPRIMIDO cada día durante 5 días.\nEBASTEL FORTE 20MG 20 COMPRIMIDOS RECUB CON PELIC. 1 COMPRIMIDO cada día durante 20 días.\nCEFDITORENO 200 MG/ 20 COMPRIMIDOS RECUBIERTOS. 1 COMPRIMIDO cada 12 horas durante 5 días.', NULL),
(24, '2019-01-04 00:00:00', '2019-03-07 00:00:00', '2019-03-07 00:00:00', 0, NULL, NULL, 13, 4, NULL, 5, 12, 1, NULL, 9, 1, 2, NULL, 'Cirugía maxilofacial', 'No refier alergias medicamentosas\nSin antecedentes de interés para la intervención actual', NULL, NULL, 'Favorable, correcta adaptación al medio. Cumple criterios de Aldrete modificados UCSI', 'CORDALES MAL POSICIONADOS (P)', NULL, 'EXODONCIA QUIRURGICA CORDALES SUP E INF\nExodoncia quirúrgica de 18.28.38.48\nColgajo mucoperióstico\nOsteotomía\nOdontosección 38.48\nLegrado\nLavado por arrastre', 'Dormir con la cabecera elevada\nAplicar hielo local durante 24 horas\nDieta blanda y fría durante 48 horas\nEnjuagues con agua y sal a partir de mañana\nLos puntos caerán solos\nEn caso de sangrado, morder una gasa durante una hora', 'AUGMENTINE PLUS: 2 comprimidos cada 12 horas por 7 días\nENANTYUM 25mg: 1 comprimido cada 8 horas por 5 días\nZAMENE 30mg: 1 cada 8 horas durante 3 días, luego 1 cada 12 horas durante 3 días, luego 1 comprimido cada 24 horas por 3 días', 'Salvo alergias Complementar analgesia de MXF con:\nFrío local primeras 24 / 48 horas.\nParacetamol 650mgr ó 1gr./vo + Dexketoprofeno 25mg/vo (juntos cada 8 horas) Alternando cada 4 horas con nolotil 1-2 comp vo/8h\n+ Omeprazol 20 mg/12 h vo (hasta que dure el tratamiento) + Alprazolan 0,25 mg/noche vo (primera noche-opcional)\nRescate (si dolor intenso). Si no alergias añadir lo anterior: Metamizol 2gr (1amp bebida vo) /8h.\nLa analgesia señalada se tomará durante las 24/72 horas tras la cirugía (no a demanda). Pregunte todas las aclaraciones necesarias al personal que le ha atendido.'),
