(28, NULL, '2018-09-25 00:00:00', '2018-09-25 00:00:00', NULL, NULL, NULL, 68, 49, NULL, 5, 16, 6, NULL, 5, 1, 1, 26, 'REFIERE DISNEA DESDE HACE 48H', 'NO RAM. INTOLERANCIA A NOLOTIL\n-HTA\n-INTOLERANCIA NOLOTIL\n-Plaquetopenia en seguimiento en Hematología H la Fe\n-Nódulo de gran tamaño en polo inferior de LTD no intervenido\n-FX C2 tipo II\n-Cirugía: gonartrosis PTR Bilateral, 13/10/2015: COLECISTECTOMIA LAPAROSCOPIA\n\n-Tratamiento: Orfidal, Enalapril HTZ, Arcoxia?, Paracetamol 1g, Ventolin, Zolpidem 10, Omeprazol 20, Tardyferon, Zyloric 100, Zaldiar, Ventolin inh.', NULL, 'NO DOLOR TORÁCICO, DISCRETOS SÍNTOMAS DE RESFRIADO. NO MUCOCIDAD PERO LA OBSERVO CON DISCRETA TOS HÚMEDA. AFEBRIL. REFIERE OTROS EVENTOS SIMILARES QUE CONTROLA CON VENTOLIN INHALADO. DIAS PREVIOS CON PROCESO DE GASTROENTERITIS', NULL, 'Disnea', NULL, NULL, NULL, NULL, NULL),
(29, NULL, '2018-11-11 00:00:00', '2018-11-14 00:00:00', NULL, NULL, NULL, 60, 63, NULL, 3, 8, 1, NULL, 6, 1, 2, 28, 'Programado por consultas externas COT', 'Hiperuricemia, DL, artrosis, obesidad mórbida, Hernia umbilical recidivada. \nAngor hace 4 años. No portador de ningún stent. tabique nasal. \nPaciente sin transfusiones anteriores sin complicaciones reseñables.\nNo Alergias\nFumador de 2 cigarrillos al día: Consumo de alcohol Moderado. No consumidor de drogas.\nIntervenido de los referidos con las siguientes complicaciones: NO\nHa recibido anestesia loco regional: En la que presentó No.', 'Artoplastia de cadera derecha Biolox-PE vástago –Karey – SURGIVAL-', NULL, 'Evoluciona de forma satisfactoria por lo que se decide alta hospitalaria.', 'Artoplastia de cadera derecha', NULL, 'Artoplastia de cadera derecha', 'Prótesis primaria estándar no cementada', 'Hibor 5.000 1/24 h. durante 4 semanas\nNolotil 1/6 h. según dolor.\nZaldiar 1 cada 8h si dolor', 'Acudir a visita cin Rx de control: en 1 mes Co14 (Dr Hernández)\nRetirar puntos de sutura baho control médico de cabecera a partir de los 21 días de la intervención. Recomendaciones terapéuticas prótesis cadera ABORDAJE POSTEROLATERAL.\nDeambulación con andador realiando carga parcial progresiva\nRealizar paseos frecuaentes y cortos\nMEDIDAS PREVENTIVAS LUXACIÓN CADERA: utilizar alza en el baño, no cruzar las piernas, no flexionar la cadera mñas de 70º, no girar hacia deotro los pies (precaución en el alzado y recoger objetos del suerlo)\nLa aparición de fiebre, malestar haneral, manchado excesivo herida quirírgica, dolor no controlado con anakgesia habitual debe ser motivo de revisión por su médico/especialista.'),
(30, '2019-09-01 00:00:00', '2019-04-04 00:00:00', '2019-08-07 00:00:00', 0, NULL, NULL, 61, 54, NULL, 19, 14, 1, NULL, 6, 1, 1, 33, 'Mujer 77 años que ingresa por enfermedad común procedente de servicio del propio centro urgencias medicas', 'No alergias\nNo hábitos tóxicos\nDislipemia, No HTA, no DM\n77 años, vive en residencia desde hace dos años dependiente total\nCognitivamente está muy bien, se mueve en silla de ruedas\nDisfagia a líquidos. Líquidos con espesante.\n*Antecedentes médicos:\nPoliomielitis en la infancia con secuelas. Ataxia cerebro-espinal (Joseph-Machado(enf)). Come dieta triturada y bebe con espesantes.\nCitopenias en estudio\nIngresada en UMCE por sepsis respiratorio\nOsteoartrosis\nSindrome ansioso-depresivo\n*Antecedentes quirúrgicos:\nPrótesis de rodilla izq. desplazada sin poderse intervenir por ausencia de masa muscular.', 'Paciente de 77 años con ataxia espinocerebelosa dependiente total institucionalizada desde hace dos años, diagnosticada de TEP de bajo riesgo', NULL, 'Tratamiento con clexane, levofloxacino, fluidos broncodilatadores, evoluciona satisfactoriamente. Control de MAP', 'Infeccion respiratoria', 'Tep pulmonar arterias segmentarias basales\nAtaxia\nDisfagia funcional', 'Hemograma\nHemostasia', '', 'LORAZEPAM 1MG 1compxdia\nZOLPIDEM 10MG 1 compxdia\nDIETA DISFAGIA\nLEVOFLOXACINO 1COMPxdia', 'Pedir fecha en consultas externas en medina interna'),
(31, '2019-04-09 00:00:00', '2019-04-07 00:00:00', '2019-04-07 00:00:00', NULL, NULL, NULL, 68, 54, NULL, 17, 14, 6, 30, 6, 1, 1, 33, 'Remitida por insuficiencia respiratoria(ver informe)', 'Osteoporosis, osteoartritis, ataxia cerebelosa, HTA, Poliomielitis en la infancia con secuelas, síndrome mieloproliferativo crónico, prótesis de rodilla izquierda, otitis media crónica, disfagia neurofaringea, trombo embolismo pulmonar en 2018, síndrome ansioso-depresivo, sin alergias. Institucionalizada en residencia de tercera edad. Dependiente para toda actividad. Se desplaza en silla de ruedas.\n\nTratamiento habitual Lorazepam\nZolpidem\nNolotil\nParecetamol\nFerplex\nLyrica\nOmeprazol\nClexane\nDiosmina\nHeipram', 'Acude a Urgencias remitida desde su residencia por referir desde hace días somnolencia y desorientación.\nEsta mañana presenta disnea,tos y mas somnolencia e incapacidad de mantener el tono muscular debilidad en ambas manos\nse observa desaturación 89% y fiebre 39ª, por su patologia sufre infecciones respiratorias recurrentes y episodios de broncoaspiración', 'TA 112/75 \nT39ª\nSat02\nFC 76lpm\nConsciente y orientada pero somnolenta.', 'La familia refiere que la paciente no podia mover el brazo derecho ni las manos. Solicito TAC cerebral y quedo con la acompañante.', 'EPISODIO DE SATURACION AUTOLIMITADO', 'Paciente institucionalizada', 'GASOMETRIA\nTX TORAX\nTAC CRANEAL\nHEMOSTASIA', NULL, NULL, 'Remitir medico de cabecera'),
