(33, '2019-10-09 00:00:00', '2019-10-08 00:00:00', '2019-10-09 00:00:00', NULL, NULL, NULL, 47, 64, NULL, 29, 9, 1, NULL, 6, 1, 1, NULL, 'Mujer de 83 años de edad que ingresa por ENF. COMÚN procedente del SERVICIO DEL PROPIO CENTRO - GINECOLOGÍA (consulta)', 'No RAM \nAntecedentes médicos: DMO insul dep + HTA, obesa\nIntervenciones quirúrgicas. TOT hace 9 años\nG4P3A1\nMenopausia a los 53 años', 'Seguida de CCEE Ginecología por lesión vulvar.\nHallazgo en anatomía patológica de biopsia incisional de vulva derecha:Lesión escamosa intraepitelial vulvar de alto grado (HSIL/VIN II) sin signos de infiltración estromal con inflamación crónica moderada.\n\nSe realizó el dí 01/08/2019 RESECCIÓN DE LESIÓN VULVAR CON MÁRGENES.\nEn anatomía patológica:VIN II/H-SIL, márgenes laterales afectados, profundos libres, por lo que se programa para ampliar márgenes.\n\nSe programa para cirugía de escisión amplia de los márgenes de la lesión anterior (VIN II) en vulva derecha. Se realiza sin incidencias el día 08/10/2019', NULL, NULL, 'VIN II (NEOPLASIA VULVAR INTRAEPITELIAL GRADO II)', 'DMO insul dep \nHTA\nObesa', 'ESCISIÓN AMPLIA DE LESIÓN VALVULAR', NULL, NULL, NULL),
(34, '2008-10-25 00:00:00', '2008-10-20 00:00:00', '2008-10-25 00:00:00', NULL, NULL, NULL, 68, 56, NULL, 13, 7, 6, NULL, 1, 1, 1, NULL, 'Acude a Urgencia por cuadro de dolor precordial,fiebre y clínica miccional.', NULL, NULL, NULL, NULL, 'Neoplasia de sigma localmente avanzada', 'Cardiopatía isquémica (ANGOR)\nDM tipo 2\nDislipemia\nHTA\nSepsis urinaria\nTriple by-pass coronario (en ingreso anterior)', 'Sigmoidectomía ampliada.\nCateterización ureteral', 'Control por su M.A.P.\nVida basal activa, evitando realizar esfuerzos durante un mes y portando faja.\nDieta blanda 1500 kcal. Sosa.\nAnalgésico habitual si dolor.\nContinuar su tratamiento habitual', 'Plavix\nInsulina\nCoronur\nEnalapril \nCardyl\nOmeprazol 20mg 1 comp. CD/24h V.O.\nClexane 40 mg una inyección SC CD/24h durante 15 días\nSeguril 1 comp CD/24h V.O.\nMycostatin en pliegues', 'Acudir a la Consulta externa de cirugía en la fecha citada.'),
(35, NULL, '2019-03-21 00:00:00', '2019-03-26 00:00:00', NULL, NULL, NULL, 47, 83, NULL, 3, 9, 1, NULL, 6, 1, 2, 26, 'Mujer de 84 años de4 edad que ingresa por ENF. COMUN procedente de SERVICIO DEL PROPIO CENTRO -ONCOGINECOLOGIA [CEX]', 'ANTECEDENTES PERSONALES:\n-	Médicos: EPOC, depresión en tto\n-	Quirúrgicos: CST, malla pared abdominal\n-	No RAMc\n-	Gineco-obstétricos:\no	MP 46 años\no	G5 P3 C1 A1\nTTO ACTUAL:\n-	TELMISARTAN SANDOZ 40MG 28 COMPRIMIDOS\n-	ALDACTONE 25MG 50 COMPRIMIDOS RECUBIERTOS DE PELICULA\n-	DALPARAN 10 MG 28 COMPRIMIDOS RECUBIERTOS DE PELICULA\n-	MIANSERINA 10MG/50 COMPRIMIDOS\n-	DOBUPAL RETARD 150MG 30 CAPSULAS DURAS LIB PROLON \n-	FOSTER NEXTRHALER 100/6MCG/INHALACIÓN 1 INHAL 120 DOSIS POLVO INHALAC\n-	SPIRIVA RESPIMAT 2,5 MCG 60 PULSACIONES (30 DOSIS) 1 INH + 1 CART SOL INHAL\n-	PARACETAMOL 1000 MG/ 40 COMPRIMIDOS\n-	OMEPRAZOL 20 MG/28 CAPSULAS\nSITUACIÓN SOCIAL:\nECOG1\nIndependiente para las actividades de vida diaria, vive sola', 'Paciente de sexo femenino de 84 años que ingresa para intervención programada por cáncer de vulva\nHISTORIA ONCOLÓGICA\nBulto en genitales de 1 año de evolución\nPdte de resultados Bx realizada en el 14/2/2019: carcinoma epidermoide bien diferenciado e infiltrante.', 'Tumoración vulvar central peroclitoridea ulcerada de 5.5 cm x 3.5 cm, no adherida a planos profundos, a distancia de meato uretral, uretra impresiona libre a exploración\nPosibilidad de cierre directo de defecto\nIngles libres\nExploraciones complementarias\n27/02/2019 – TC TÓRAX ABDOMEN PELVIS con contraste iv.\nInforme:\n-	Tórax\nNo nódulos ni consolidaciones pulmonares. Bronquiectasias y cambios fibrosos en ambas bases pulmonares. \nNo adenopatías mediastínicas, hiliares, en cadenas mamarias internas ni axilares.\nNo derrame pleural ni pleural ni pericárdico\n-	Abdomen – Pelvis:\nHígado homogéneo sin lesiones focales. Colelitiasis múltiple, vesícula distendida. No dilatación de vía biliar. \nBazo, páncreas, riñones y suprarrenales in alteraciones significativas (cambios atríficos renales y pancreáticos)\nNo adenopatías en las cadenas ganglionares abdomino-pélvicas\nNo líquido libre intraabdominal\n\nEn ventana de hueso no lesiones sospechosas de metástasis. Cambios osteodegenerativos.\n\nConclusión:\n-	Sin adenopatías ni signos de enfermedad a distancia\n-	Incidentalmente: colelitiasis, diverticulosis\nSe explica procedimiento quirúrgico (hemivulvectomía + BSGC + LFDN inguinal +/- pélvica), que entiende y acepta. Firma los correspondientes consentimientos informados.\nIngresa el día 21/03/2019', 'Técnica quirúrgica \n1º tiempo: BSGC\nInyección de 2ml de ICG diluido peritumoral.\nIncisión en media luna alrededor de 2-4cm por dentro y 2cm debajo de espina iliaca anterior superior. Extensión por encima del borde superior de ligamiento inguinal.\nResección de franja de piel de 2-4 cm con capa de TSCS. Profundización de incisión superior.\nNo se identifica migración del colorante en ninguna de las 2 áreas inguinales.\n2º tiempo: Linfadenectomía inguinal bilateral\nResección de franja de 2-4cm con capa de TSCS. Profundización de incisión superior incluyendo tejido adiposo con ganglios linfáticos que se encuentran encima de ligamento inguinal y alrededor de vasos circunflejo iliaco superficial y epigástrico superficial. Disección de angulos laterales separando de aponeurosis de Sartorio.\nIdentificación de vena safena a su ingreso en región del triangulo femoral. Aislamiento y ligadura. Disección de la vena hacia arriba con el tejido linfoganglionar en bloque que la rodea, separándola de aponeurosis del Sartorio y Aductor. Disección en bloque hasta fosa oval.\nDrenaje: Tipo: Redon\nCierre TCSC con puntos sueltos\nPiel: Intradérmica\nLINFADENECTOMIA INGUINAL bilateral\nComplicaciones: no\n3º tiempo: vulvectomia\nIncisión peritumoral obteniendo 2 cm de tejido sano, con extensión de las incisiones labiocrurales hacia bordes externos de la fascia profunda del diafragma urogenital. Disección en sentido dorsal. Ligadura de vsos pudendos internos a las 4 y 8 horarias. Pinzamiento y sección de base vascularizada del clitorix.\nAmpliación de bordes profundos: tercio inferior y medial\nCierre de incisión vulvar y perineal.\nDrenaje: redon\nComplicaciones: no adecuada para la cirugía.\nEvolución adecuada, heridas en buen estado, drenajes funcionantes.', 'NEOPLASIA EN VULVA', 'NEO DE VULVA', 'DESCRITOS EN LA EVOLUCIÓN', '', 'Su trtº habitual.\nHibor 3500 sc/24h durante 20 días\nParacetamol sin dolor, cada 8 ó 6 horas.\nDuphalac sobres cada 12 horas.\nMantener heridas limpias y secas, aplicando clorhexidina tras la higiene.', 'Anotar diariamente en papel, lo que ha drenado cada redon, y asimismo, marcar en la botella. \nVigilar que no pierda el vacío y si es así, reponerlo según se le ha indicado al familiar.\nCuando acuda a la cita de técnicas, se valorará la AP si se dispone, y de lo contrario se remitirá a ONCOLOG cuando finalice los controles de drenajes.\n\nRecuerde que tiene usted la/s siguiente/s cita/s:\nEl viernes 29 de Marzo de 2019 a las 12:00 AGENDA TECNICAS ONCO-GINE; ubicada en Ginecología'),
(36, NULL, '2011-02-28 00:00:00', '2011-03-02 00:00:00', NULL, NULL, NULL, 12, 84, NULL, 3, 17, 1, NULL, 6, 1, 1, 26, 'Paciente de 74 años de edad que ingresa procedente de Urgencias por pérdida de conciencia y diarrea.', 'Hipergluzemia (dieta). Diabetes mellitus tipo 2. HTA. Intervenido dos veces de vavulopatía mitral y aórtica (1988, 2001) en seguimiento Hospital la Fe.', 'Trída por SVB a urgencias por cuadro sincopal con caída al suelo y pérdida breve de conciencia en el contexto de diarrea aguda. Días previos infección gastrointestinal su esposa. En urgencias vuelve a tener cuadro vagal en los boxes.', 'Tª 35,1ºC, TA 108/48; FC 68 bm; SatO2 100%; consciente, orientado y con regular estado general. AF: Murmullo vesicular telediastólico. Rítmico. Abdomen blando y depresible, no doloroso, sin signos de irritación peritoneal y sin evidencia de visceromegalias ni masas. No edemas tibiomaleolares.\n\nPROVES COMPLEMENTARIES / PRUEBAS COMPLEMENTARIAS\nHEMOGRAMA: Leucocitos: 8.880/mmc. Neutrófilos: 89.10% Hemoglobina: 11 g/dl. Hematocrito: 35%. Plaquetas :1/1.000 /mmc. PCR: 3mgl.    \nBIOQUÍMICA: Glucosa: 148 mg/dl. Urea: 65 mg/dl. Creanina. 1.90 mg/dl. Sodio 133mmd/l. Potasio: 4.9 mmd/l.\nGASESPH: 7.31. PC02: 48.8. P02: 13.2. ARTERIAL:\nRx de tórax: Discreta cardiomegalia con ICT 55%. Prótesis valvular metálica mitra.', 'Con hidratación y dieta astrigente, mejoría sintomática, desaparición de los vómitos y diarrea. Normalización de la función renal al alta. Se reinicia el sintrom', 'Diarrea aguda vírica', 'SINCOPE VASOVAGAL\nVALVULOPATOA MITROARTICO INTERVENIDA. ANTICOAGULACIÓN', NULL, NULL, NULL, NULL),
(37, '2008-10-02 00:00:00', '2008-10-02 00:00:00', '2008-10-10 00:00:00', 0, NULL, NULL, 9, 6, NULL, 1, 1, 1, NULL, 6, 1, 1, 17, 'Paciente de 64 años procedente del servicio de cardiología, que ingresa con carácter de urgencia con el diagnóstico de enfermedad coronaria, IAMSEST. Se indica cirugía urgente.', 'No alergias medicamentosas conocidas, tabaquismo, hipertensión, accidente cerebrovascular previo (año 2001, con hemiparesia de lado derecho dominante), enfermedad vascular periférica y enfermedad cerebrovascular (oclusión de carótida derecha y cirugía previa sobre carótida izquierda). Síndrome depresivo.', 'Angina inestable post-infarto en grado funcional IV de la CCS. Disnea en grado funcional III de la NYHA. IAMSEST al ingreso.', NULL, 'Postoperatorio: \nEl paciente no presentó complicaciones dignas de mención. \nRetención de orina tras quitar sonda vesical (resondaje). Buena evolución posterior.\nAl alta, el paciente se encuentra con buen estado general, afebril y con auscultación cardiorrespiratoria sin hallazgos significativos.', 'IAMSEST.', 'Tabaquismo.\nHipertensión.\nAccidente cerebrovascular antiguo con hemiparesia lado derecho dominante\nEnfermedad vascular periférica.\nEnfermedad cerebrovascular: oclusión carótida derecha.\nArterioesclerosis de aorta.\nEnfermedad vascular periférica.\nEnfermedad coronaria de 3 vasos.\nRetención urinaria por sondaje.\nSíndrome depresivo.', 'Electrocardiograma:\nRitmo: sinusal. Eje: normal.\nOtros: IAM post-basal.\nRx de Tórax: Cardiomegalia y signos de edema pulmonar.\nRealizado Cateterismo nº: 15776. (11/02/2008). F.E.: 46%\nCoronariografía con radiografía simple. \nEnfermedad 3 vasos. Estenosis severa de DA, estenosis severa de Cx y CD, obstrucción de DA, obstrucción de CD.\nEl paciente es presentado en sesión médico quirúrgica y aceptado para intervención que se realiza el 14/02/2008, practicándose bajo circulación extracorpórea.\nSe realizan 5 injertos coronarios.\n- vena safena interna de miembro inferior derecho termino-lateral a arteria coronaria primera diagonal (1.8 mm). Calidad del vaso buena. Proximal anastomosado a la aorta.\n- arteria mamaria interna izquierda termino-lateral a arteria coronaria segunda diagonal (1.4 mm). Calidad del vaso mala. Injerto pediculado.\n- arteria radial izquierda latero-lateral a arteria coronaria primera marginal (1.8 mm). Calidad del vaso buena. Proximal anastomosado a la aorta.\n- vena safena interna de miembro inferior derecho termino-lateral a arteria coronaria descendente posterior (1.8 mm). Calidad del vaso buena. Proximal anastomosado a la aorta.\n- arteria radial izquierda termino-lateral a arteria coronaria rama postero lateral PL (1.6 mm). Calidad del vaso regular. Secuencial de radial Mg.-TPL. \nAorta ascendente ateromatosa. \nQuintuple bypass coronario y arterial.', 'Curas ambulatorias diarias de la/s heridas quirúrgica/s.', 'AAS 200mg/24h.\nBaycip 500mg/12h durante 10 días y suspender. \nCoropres 6.25mg/24h.\nPantecta 20mg/24h.\nZarator 40mg/24h.\nPlavix 1 comp/24h.\nNorvas 5mg/día.\nSereprostat 80mg 2c/12h vo.\nSeropram 20mg/día (según pauta previa).\nEfferalgan 1g/8h si dolor.', 'El paciente deberá acudir al servicio de urgencias en caso de fiebre o deterioro del estado general. \nEl paciente deberá seguir control de su patología con revisiones por su Cardiólogo de su Hospital de referencia, para lo cual deberá contactar en los próximos días.\nSe recomienda control de sus factores de riesgo cardiovascular (hipertensión, triglicéridos, colesterol, diabetes, etc...) por parte de su médico de cabecera.'),
(38, NULL, '2014-11-21 00:00:00', '2014-11-25 00:00:00', NULL, NULL, NULL, 50, 87, NULL, 5, 13, 3, NULL, 6, 1, 2, 27, 'Hombre de 63 años de edad que ingresa de forma programada desde Hospital de día para tratamiento.', 'No reacciones adversas medicamentosas conocidas.\nNo hábitos tóxicos.\nHipertensión arterial.No diabetes mellitus ni dislipemia.\nIntervenciones quirúrgicas: implantes dentales.', 'Diagnosticado de linfoma plasmablastico estadio IV-A en septiembre de 2014. VIH-.Se inicia tratamiento con QT según esquema HyperCVAD. Hasta el momento ha completado 3 ciclos demostrando quimiosensibilidad a la exploración y el TC realizado el 14/11/2014. Recolección de progenitores hematopoyéticos exitosa tras el 3er ciclo de QT. Ha presentado como incidencias ingreso por neutropenia  febril en la aplasia 1er ciclo QT sin documentación microbiológica. Lleva Hickman.', 'BEG. C y O. Exploración sin hallazgos de interés.', 'Se administra 4ª ciclo de QT según esquema  HyperCVAD entre el 21/11/2014 al 24/11/2014. La tolerancia al tratamiento ha sido optima sin complicaciones inmediatas. Se administra Neulasta el 25/11/2014 en sala previa al alta.', 'Cuarto ciclo de QT (HyperCVAD)', 'Linfoma plasmablastico en remisión completa/parcial', 'Administración del 4º ciclo de QT HyperCVAD', 'Seguirá su tratamiento habitual previo al ingreso.', 'Alopurinol pensa 300mg 30 comprimidos EFG 1 comprimido cada día.\nCiprofloxacino taucip 500mg 14 comprimidos recubiertos pelicula EFG  1 comprimido cada 12H durante 10 días.\nLorazepan 1mg/50 comprimidos 1 comprimido cada día.\nEnalapril 5mg/60 comprimidos 1 comprimido cada día.', 'Acudir al Hospital de día de hematologia el próximo día jueves 04/12/2014 a las 9h para analítica y visita.\nSi fiebre +38ªC o empeoramiento de su estado actual acudir a urgencias con el informe de alta.');
INSERT INTO `episodio` (`id`, `fecha_firma`, `fecha_inicio`, `fecha_alta`, `importe`, `finalizado`, `bloqueado`, `id_servicio`, `id_paciente`, `id_factura`, `id_dependencia`, `id_medico`, `id_tipoepisodio`, `id_episodio`, `id_circunstanciasalta`, `id_destinoalta`, `id_modalidadepisodio`, `id_usuario`, `motivo_ingreso`, `antecedentes`, `historia_actual`, `exploracion_fisica`, `evolucion_comentarios`, `diagnostico_principal`, `diagnostico_secundarios`, `procedimientos`, `tratamiento_recomendaciones`, `tratamiento_farmacos`, `recomendaciones`) VALUES
(39, NULL, '2014-10-28 00:00:00', '2014-11-03 00:00:00', NULL, NULL, NULL, 49, 88, NULL, 6, 13, 3, NULL, 6, 1, 2, 27, 'Hombre de 63 años que ingresa de forma programada desde el hospital de día para tratamiento.', 'No reacciones adversas medicamentosas conocidas.\nno hábitos tóxicos.\nHipertensión arterial.No diabetes mellitus ni dislipemia.\nintervenciones quirúrgicas: implantes dentales.', 'Diagnosticado de linfoma plasmablastico estadio IV-A en septiembre de 2014. VIH-. Se inicia tratamiento con QT segun esquema HyperCVAD. Hasta el momento ha completado 2 ciclos demostrando quimiosensibilidad a la exploración. Ha presentado como incidencias ingreso por neutropenia febril en la aplasia 1er ciclo QT sin documentación microbiologico. Pendiente de Tc de valoración solicitado desde hospital día.  Leva Hickman.', 'BEG C y O. Exploración sin hallazgos de interés.', 'Se administra 3er ciclo QT según esquema HyperCVAD entre el 29/10/2014 al 01/11/2014. La tolerancia al tratamiento ha sido optima sin complicaciones inmediatas. Se ha decidido programar recolección de progenitores hematopoyeticos  después de este ciclo. Como incidencias destacar administración de Neulasta al 02/11/2014 a pesar de que se había suspendido.', 'Tercer ciclo QT HYPERCVAD', 'Linfoma plasmablastico', 'Administración del tercer ciclo QT (HyperCVAD)', 'Seguir su tratamiento habitual previo al ingreso', 'Alopurinol pensa 300mg 30 comprimidos EFG 1 comprimido cada día.\nLorazepam 1mg/50 comprimidos  1 comprimido cada día \nLactulosa 1000mg/ 50 sobres, 1 sobre cada día.\nEnalapril 5mg/60 comprimidos, 1 comprimido cada día.\nMST 10 continus 10mg/ 60 comprimidos, 1 comprimido cada 12H.', 'Acudir el próximo lunes 10/11/2014 al banco de sangre para extracción analítica de CD34 y valoración de recolección de progenitores.'),
(40, '2014-08-03 00:00:00', '2014-07-28 00:00:00', '2014-08-03 00:00:00', 0, NULL, NULL, 45, 9, NULL, 3, 14, 1, NULL, 8, 8, 2, 17, 'Paciente ingresado en cama: 69A439.\nHombre de 61 años de edad que ingresa por METÁSTASIS OCCIPITAL IZQ. procedente del propio Hospital.\nIngresa en el servicio con fecha miércoles 30 de julio de 2014 procedente de ANESTESIA-REANIMACIÓN.', 'Alergia Bactroban pomada.\nFumador desde los 14 años hasta la actualidad de 1 paq/día. Hábito enólico moderado en la juventud.\nDMID en tratamiento con ADO e Insulina. \nParada cardiorespiratoria post-quirúrgica tras intervención en Mayo-2010.\nTrombosis de la vena basilar y posterior ACV en el territorio de la cerebral posterior izquierda en Marzo/2010 con clínica residual de espasmos en brazo izquierdo sin otra focalidad.\nIQx: amigdalectomizado en la infancia. Meniscectomía. \nHISTORIA ONCOLÓGICA:\nEl paciente fue diagnosticado en Julio de 2011 de Carcinoma epidermoide úlcero-vegetante de columela, tabique nasal y vestíbulo nasal, que fue intervenido.\nEstá previsto inicio de tratamiento con Radioterapia+ Cetuximab complementario, con buena respuesta.\nPaciente de 61 años con diagnóstico de Adenocarcinoma de Pulmón cT1a cN2 (única estación 4L) M0. Estadio IIIA.\nRecibió tratamiento neoadyuvante con esquema TAXOL-CARBOPLATINO hasta completar 3 ciclos en Mayo 2013. Con criterios de enfermedad estable.\nEl 15/07/2013 se realiza segmentomía del 6 con DSM. La anatomía patológica informó de ausencia de tumor primario. Infiltración por adenocarcinoma de área 4L y 11. (0/1 de áreas: 10,8,5,7. 1/1 de áreas 4L y 11).\nLa impresión diagnóstica fue ADENOCARCINOMA ypT0 ypN2 M0. Recibe radioterapia externa 3D con fotones de 6 MV mediante 7 campos conformados sobre áreas 7, 2L, 4L e hilio izquierdo administrando una dosis de 50 Gy con fraccionamiento de 200 cGy/día, entre el 5/9 y el 10/10/13. En último control radiológico, sin cambios respecto al estudio precedente. Sin evidencia de enfermedad (TAC 25/04/14).', 'Paciente de 61 años de edad que ingresa de manera programada para ser intervenido por Metástasis cerebral de posible origen pulmonar.', 'Al alta:\n- COC, GCS 15, PICNR.\n- No alteración de PC.\n- No signos de HTIC.\n- Cuadrantanopsia inferior derecha.\n- Balance motor 5/5.\n- No alteración de la sensibilidad.\n- Herida de buen aspecto.\n- Apirético.', 'El paciente ingresa en la sala de neurocirugía procedente de reanimación sin presentar complicaciones derivadas del proceso anestésico quirúrgico. Inicia tolerancia oral y sedestación/deambulación sin incidencias reseñables. Durante el ingreso el paciente presenta un mal control glucémico por lo que se solicita valoración por el servicio de endocrinología quienes ajustan tratamiento. Dada la favorable evolución clínica se decide alta hospitalaria y control en consultas externas de neurocirugía.', 'TUMOR CEREBRAL.', 'Alergia Bactobran.\nFumador.\nHábito enólico moderado en la juventud.\nDMID en tratamiento con ADO e Insulina.\nParada cardiorespiratoria post-quirúrgica tras intervención en Mayo-2010.\nTrombosis de la vena basilar y posterior ACV en el territorio de la cerebral posterior izquierda en Marzo/2010 con clínica residual de espasmos en brazo izquierdo sin otra focalidad.', 'Estudio preoperatorio dentro de la normalidad.\nR.M. Cerebral con contraste, 11/07/2014.\nSe practican planos axiales, sagitales y coronales con secuencias potenciadas en T1, T2, GRE T2* y FLAIR. Se completa estudio con secuencia axial difusión. Administramos contraste (gadolinio.28ml iv nc-6836. Estudio Tumor Funcional: Espectroscopia TE largo: 1144, Estudio de Perfusión y Difusión B:3000. \nLOE lóbulo occipital izquierdo de 5 x 4 x 5 cm de diámetro en planos axial, coronal y sagital, rodeada de edema perilesional, en contacto con el asta occipital izquierda sobre la que ejerce efecto masa desplazando y obliterándolo, tras la administración del contraste presenta realce periférico con amplia área de necrosis central. Mediante el estudio de perfusión-espectroscopia se demuestra perfil tumoral de la lesión sin infiltración del parénquima cerebral adyacente, orientando los hallazgos a metástasis en la localización descrita. No se observan otras lesiones metastásicas en el resto del estudio.', 'Continuar con su tratamiento habitual excepto adiro, deberá acudir a su MAP para valorar reintroducción.\nDeberá acudir a su MAP para control glucémico y ajuste de tratamiento si precisa.\nCura plana diaria de la herida con betadine y retirada de agrafes en 15 días en su centro de salud.', 'CEFUROXIMA 500 MG / 15 comprimidos recubiertos. 1 COMPRIMIDO cada 12 horas durante 7 días.\nPARACETAMOL 1000 MG / 40 comprimidos.  1 COMPRIMIDO cada 8 horas durante 13 días.\nDEXAMETASONA 2 mg/ vo/ 12h durante 4 días. 1 mg/ vo/ 12h durante 4 días. 1 mg/ vo/ 24h durante 4 días y retirar.', 'Se notificará mediante correo ordinario la fecha definitiva para la cita en consultas externas de neurocirugía.\nDeberá acudir a consultas externas de oncología para nueva cita.'),
(41, '2014-07-08 00:00:00', '2014-07-02 00:00:00', '2014-07-08 00:00:00', NULL, NULL, NULL, 49, 92, NULL, 23, 13, 6, NULL, 8, 8, 1, 31, 'Hombre de 61 años de edad que ingresa por Adenocarcinoma del pulmón procedente de Urgencias', 'Alergia Bactroban pomada\n-Fumador desde los 14 años hasta la actualidad de 1paq/día. Hábito énolico moderado en la juventud.\n-DMID en tratamiento con ADO e insulina.\n-Parada cardiorrespiratoria postquirúrgica tras la intervención en mayo-2010\n-Trombosis de la vena basilar y posterior ACV en el territorio de la cerebral posterior izquierda en Marzo/2010 con clínica residual de espasmos en brazo izquierdo sin otra focalidad.\n-IQx: amigdalectomizado en la infancia. Meniscectomía.\nHISTORIA ONCOLÓGICA:\nEl paciente fue diagnosticado en Julio de 2011 de carcinoma epidermoide úlcero vegetante de columela, tabique nasal y vestíbulo nasal, que fue intervenido.\nEstá previsto inicio de tratamiento con Radioterapia + Cetuximab complementario, con buena respuesta.\nPaciente de 61 años con diagnóstico de adenocarcinoma de pulmón cT1a cN2 (única estación 4L) M0. Estadio IIIA\nRecibió tratamiento neoadyuvante con esquema TAXOL-CARBOPLATINO hasta completar 3 ciclos en mayo 2013. Con criterios de enfermedad estable.\nEl 15/07/2013 se realiza segmentomía del 6 don DSM. La anatomía patológica informó de ausencia de tumor primario. Infiltración por adenocarcinoma de área 4L y 11. (0/1 de áreas: 10,8,5,7. 1/1 de áreas 4L y 11).\nLa impresión diagnóstica fue adenocarcinoma ypT0 ypN2 M0. Recibe radioterapia externa 3D con fotones de 6MV mediante 7 campos conformados sobre áreas 7, 2L, 4L e hilio izquierdo administrando una dosis de 50 Gy con fraccionamiento de 200 cGy/día, entre el 5/9 y el 10/10/13. En último control radiológico, sin cambios respecto al estudio precedente. Sin evidencia de enfermedad (TAC 25/04/14).', 'Acude a UMED por cuadro de 3-4 días de evolución de pérdida de fuerza en brazo y pierna derecha, cefalea nucal y frontal sin asociar alteraciones sensitivas, en el habla (si la familia lo nota “más despistado”), alteraciones visuales, pérdida de conciencia. La dificultad de fuerza en la extremidad le impide la deambulación. Niega clínica infecciosa respiratoria, abdominal ni urinaria.', 'BEG: Consciente y orientado. Colaborador con lenguaje conservado. Eupneico en reposo.\nAC: Rítmico sin soplos.\nAP: MVC con roncus dispersos.\nAbdomen: Blando y depresible sin masas y megalias. No doloroso ni signos de irritación peritoneal.\nMMII sin edemas ni signos de TVP.\nNeurológico: Consciente y orientado en persona, no en tiempo ni espacio. Bradipsiquia. Lenguaje coherente sin disartria. Impedimento para la mirada superior bilateral. Resto de PPCC sin alteración. Claudicación de miembros derechos con sensibilidad conservada. Marcha dificultada por arrastre de MID.', 'Durante su hospitalización se inicia tratamiento antiedema con manitol y fortecortin con buena respuesta recuperando la función motora, pero persistiendo el déficit campimétrico derecho. Se completa estudio mediante Resonancia Magnética Cerebral y TAC. Pendiente de realización de PET-TAC para confirmar la ausencia de enfermedad, a otros niveles se solicita valoración por Neurocirugía y preanestesia. Tras ser valorado por parte de Neurocirugía solicita ampliación de estudio mediante Resonancia Magnética Cerebral con espectroscopia y difusión ante las dudas diagnosticas del origen de la lesión tumoral. El paciente es valorado por Endocrinología y sea ajusta tratamiento de la diabetes al alta. Dada la estabilidad del paciente y la mejoría clínica se decide se decide alta hospitalaria para continuar estudio de forma ambulatoria y acudir a Consultas Externas en las fechas previstas.', 'Adenocarcinoma de pulmón ypT0 ypN2 M0 en julio 2013', 'Sospecha de progresión cerebral vs primario cerebral', 'Segmentectomía +DSM\nQuimioterapia neoadyuvante.\nRadioterapia complementaria', 'TRATAMIENTO:\n-Seguir con su dieta habitual.\n-Control de Glucemia digital por tres y ajuste de tratamiento por su Médico si precisa.\n-ANTE CUALQUIER SINTOMA DE ALARMA VOLVER INMEDIATAMENTE A CENTRO HOSPITALARIO.', 'Omeprazol 20 mg un comprimido al día.\n-Fortecortin en pauta descendiente:\n		8mg en desayuno y 6 mg en comida vía oral durante días.\n		8 mg en desayuno y 4 en comida vía oral durante 3 días.\n8 mg en desayuno y 2 en comida vía oral durante 3 días y consultar nueva pauta en próxima visita en Oncología\n-Paracetamol 1 gramo vía oral cada 8 horas si dolor otras molestias.\n-Insulina Novomix 50. 30UI en desayuno. 30UI en Comida y 20UI en Cena.\n-Continuar tomando Metfotmina y Sitagliptina', NULL),
(42, NULL, '2001-12-10 00:00:00', '2001-12-19 00:00:00', NULL, NULL, NULL, 44, 85, NULL, 3, 7, 1, NULL, 6, 1, 1, 26, 'Mujer de 76 años remitida desde UHD (en control a raíz de último ingreso el 18/12/01) por empeoramiento del estado general, escasa tos y expectoración. No dolor torácico ni sensación distérmica ni aumento de disnea basal.', 'Alérgica a la Penicilina. Trabajó en una fábrica de zapatos. No hábitos tóxicos. No HTA. No ulcus. DM de difícil control en tratamiento con insulina NPH (14-0-8). Bronquiectasias difusas quísticas con severa limitación al flujo aéreo. Insuficiencia respiratoria global crónica. No neumonías ni TBC. Dos ingresos anteriores por infección respiratoria (último en Nov/01).', NULL, 'COC, REG. Caquéctica. Deshidratada. Palidez cutáneo-mucosa. Apirética. TA 100/45. No taquipnea de reposo. ACP: tonos cardíacos rítmicos, soplo sistólico grado VI/VI sugestivo de insuficiencia mitral. Gran cantidad de subcrepitantes diseminados. Abdomen anodino. MMII: no edemas. Cavidad oral: aftas en lengua y mucosas. \n\nExploraciones complementarias: \n\nRx de tórax: bronquiectasias bilaterales bibasales \n\nGasometría arterial: ph 7.35, pO2 63.7, pCO2 81.7, HCO3 43.7, Sat O2 92%. Al alta: Analítica: glucosa 132, Na 131, Hb 10, Htcto 32.9, VCM 69.8, HCM 21, 14300 leucocitos (83% Ne). Perfil hepático y lipídico dentro de la normalidad. Sideremia 6, CTFH 127, IST 4.72. Hormonas tiroideas dentro de la normalidad. Hemostasia normal. Sedimento de orina: más de 100 leucos/campo. \n\nECG: ritmo sinusal', 'Favorable dentro de su estado basal por lo que es remitida a domicilio con control domiciliario por UHD.', 'Bronquiectasias difusas bilaterales con OCFA', 'Infección respiratoria \n\nDiabetes mellitus \n\nAnemia ferropénica \n\nInfección de tracto urinario', NULL, NULL, 'Dieta blanda diabética e hiposódica. \n\n2.- Clapping y drenaje postural mañana y noche \n\n3.- Oxígeno en gafas nasales de 1.5 lpm al menos 18 h diarias \n\n4.- Tavanic 500 mgr, 1 comp/24 h/5 días más \n\n5.- Insulina NPH (10-0-0) \n\n6.- Ventolín 2 inh/6 h con cámara Aerochamber \n\n7.- Atrovent 2 inh/6 h con cámara \n\n8.- Ferrogradumet 1 comp/24 h \n\n9.- Dayamineral 1 comp/24 h  \n\n10. Solución de ketoconazol al 2%, Lidocaína al 2%, Triamzinolona 0.2%, Vitamina C 0.05% y Orobase \n\n100 mgr csp. Aplicar cada 6h en aftas de mucosas y lengua. \n\ncontrol en Policlínica de Neumología según fecha prevista y por médico de cabecera.', NULL),
(43, '2000-01-23 00:00:00', '2000-01-23 00:00:00', '2000-02-02 00:00:00', NULL, NULL, NULL, 18, 94, NULL, 24, 8, 1, NULL, 6, 1, 1, 31, 'Ingresa por aparición de edema en pene y erosión superficial en la raíz del mismo', 'Paciente varón de 70 años de edad con AP: DMNID, con micro y macroangiopatía, amputación de ambos MMI, demencia multiinfarto, incontinencia de esfínteres y portador de colector de orina.', 'Ingresa por aparición de edema en pene y erosión superficial en la raíz del mismo, debido a la presión ejercida por el esparadrapo usado para sujetar el colector de orina. Afebril durante todo el ingreso. Se administra tratamiento antibiótico y curas locales con Gevramicina crema, evolucionando las lesiones favorablemente, desapareciendo el edema linfático del pene y comenzando lentamente la epitelización de la erosión.\nEn muñón de amputación de pierna derecha se exterioriza el extremo distal del fémur, por lo que es revisado por el servicio de cirugía vascular, quedando pendiente de avisar y citar al enfermo, para reamputación', NULL, NULL, 'Edema linfático por compresión.', '', NULL, NULL, 'Curas diarias con Gevramicina crema 2 aplicación al día.\nSondaje uretral hasta que epitelice totalmente la erosión, y mientras, cambio de sonda uretral cada 15 días por ATS de su ambulatorio.', NULL),
(44, '2010-10-05 00:00:00', '2010-10-01 00:00:00', '2010-10-05 00:00:00', 0, NULL, NULL, 9, 5, NULL, 30, 1, 1, NULL, 1, 1, 1, 17, 'Paciente ingresado en cama: 08B315.\nMujer de 84 años de edad que ingresa por ICC DESCOMPENSADA. EAP procedente de Urgencias.', 'No RAM conocidas.\nNo HTA, no DM, no DL conocidas. No fumadora ni otros hábitos tóxicos. \nCardiopatía Isquémica Crónica: IAMEST Anteroseptal Killip II en Agosto 2013.\n*Cateterismo: Oclusión de ADA media con ACTP e implante de stent convencional en ADA media. \n*Ecocardio Agosto 2013: VI ligeramente dilatado, con hipocinesia antero-lateral a nivel de segmentos medios y apicales, con depresión ligera de FEVI. FE global conservada. FE x teicholz 51%. FEpor simpson 44%. Al normal (área de 18 cm2). AD normal (área de 12 cm2). VD ligeramente dilatado (VDD 46 mm basal), con contractilidad normal. TAPSE 32 mm. tricuspide de 16 cm/s. Patrón diastólico restrictivo, con signos de aumento de PTDVI. E/e 24 Válvula aórtica trivalva, esclerosa, con buena apertura, e insuficiencia de grado II. Válvula mitral con dilatación del anillo, fibrosis de velos, e insuficiencia de grado II (jet central, V. contracta de 4 mm). Insuficiencia tricuspide severa, hasta de techo de AD, con inversión en venas suprahepáticas, que permite estimar PAPS de 60-62 mm/hg. Cava dilatada, con normal colapso inspiratorio. Ausencia de derrame pericárdico.\nEn control por cardiólogo de zona en Mayo 2014: CCS I/IV. NYHA basal I/IV.\nArtrosis.\nTRATAMIENTO FARMACOLÓGICO HABITUAL: Enalapril 2.5 x 1/48 hs, Omeprazol 20 x 1, Duoplavin 75/100 x 1, Emconcor cor 2.5 x 1, Atorvastatina 80 x 1.', 'Mujer de 84 años de edad traída por el SAMU por presentar la noche antes del ingreso, disnea rápidamente progresiva hasta hacerse de reposo. No ortopnea, no DPN  ni edematización periférica. \nA la llegada del SAMU, se objetiva TA 178/102, FC 104 lpm, SO2 97%, GD 114, Glasgow 15 e hipoventilación global con sibilancias. \nNo refiere clínica anginosa, palpitaciones ni otros síntomas de interés los días previos.', 'TA 120/70, Fc 78, sat (GN 2L) 95%, afebril.\nConsciente, orientada, colaboradora.\nBuen estado general, normohidratada, normocoloreada, eupneica en reposo.\nAC: rítmica sin soplos.\nAP: crepitantes bibasales y disminución del murmullo en bases.\nMMII: no edemas.\nExploración complementaria:\nEN URGENCIAS:\n- ECG: RS a 100 lpm, con PR normal, QS en cara anterior con supradesnivel residual en V1 y V2 y onda T isodifásica en dichas derivaciones (IAM antiguo). Sin cambios respecto a ECGs previos y seriados sin dolor.\n- Rx Tórax: Cardiomegalia. Signos de edema intersticial y pinzamiento de ambos senos costofrénicos.\n- Analítica: destaca NTproBNP 7000 pg/ml. Cr 0.68, Hb 12., Trp 14. Resto sin hallazgos de interés. \nEN SALA:\n- ECG: ritmo sinusal a 60 lpm, PR normal, QRS estrecho, eje -30º, QS V1-V2, supradesnivel ST 2 mm V1-V5, T negativa en cara inferior y V1-V5 sin cambios en ECG posteriores. \n- LABORATORIO CENTRAL: Glucosa 90 mg/dL, Urea 51 mg/dL, Creatinina 0.74 mg/dL, Filtrado glomerular Estimado (MDRD 4 IDMS) superior a 60 mL/min/ 1,73 m2, Estimación filtrado glomerular (CKD-EPI) 74,46 mL/min, Ácido úrico 6,2 mg/dL, Sodio 142 mmol/L, Potasio 3,4 mmol/L, Cloro 104 mmol/L, Colesterol 145 mg/dL, Triglicéridos 104 mg/dL, HDL Colesterol 54 mg/dL, LDL Colesterol calculado 81 mg/dL, Bilirrubina total 0,63 mg/dL, GOT/AST (Aspartato amino transferasa) 34 U/L, GPT/ALT (Alanina Amino Transferasa) 50 U/L, GGT (Gamma Glutamil Transpeptidasa) 65 U/L, Leucocitos 8,61 x 10^9/L, Neutrófilos (%) 64,40 %, Neutrófilos (Abs) 5,55 x 10^9/L, Linfocitos (abs) 2,24 x 10^9/L, Hematíes 4,45 x 10^12/L, Hemoglobina 12,7 g/dL, Hematocrito 38%, VCM 86 fL, Ancho distribución eritrocitario 14,20 %, HCM 29 pg/cél, CHCM 33 g/dL, Plaquetas 270 x 10^9/L, Índice de Quick 100%, INR 1,00, CA 125 (Antígeno carbohidrato 125) 247 U/ml, Hemoglobina Glicada (HbA1c) 5,4 %, NTproBNP (proPéptido Natriurético B) 8.772 pg/mL, TSH (Tirotropina) 0,93 µU/mL.\n- ANALÍTICA: Glucosa 116 mg/dL, Urea 43 mg/dL, Creatinina 0.80 mg/dL, Sodio 135 mmol/L, Potasio 3,5 mmol/L, Cloro 94 mmol/L, Proteína C Reactiva (PCR) 55,6 mg/L, Leucocitos 10,23 x 10^9/L, Neutrófilos (%) 81,50 %, Neutrófilos (Abs) 8,34 x 10^9/L, Linfocitos (Abs) 1,22 x 10^9/L, Hematíes 4,52 x 10^12/L, Hemoglobina 13,0 g/dL, Hematocrito 39%, VCM 85 fL, Ancho distribución eritrocitario 14,60 %, HCM 29 pg/cél, CHCM 34 g/dL, Plaquetas 254 x 10^9/L, Nitritos orina NEGATIVO, Urobilinógeno 0,2 E.U./dL, Proteínas orina (tira reactiva) 1+ , pH orina 7.0, Densidad orina 1.010, Cuerpos Cetónicos NEGATIVO, Pigmentos biliares NEGATIVO, Glucosa  Orina NEGATIVO, Sedimento urinario, Leucocitos de 15 a 25 por campo, Hematíes de 40 a 60 por campo. Se observan abundantes bacterias.\n- URINOCULTIVO: Visión directa: se observan moderados leucocitos y abundantes bacilos gramnegativos. Pendiente cultivo.\n- ECOCARDIOGRAFÍA: Ventrículo izquierdo ligeramente dilatado con hipocinesia severa de pared anteroapical y ápex, y acinesia de segmento inferobasal. Función sistólica de VI ligeramente deprimida (FEVI Simpson 51%). Patrón pseudonormal de flujo transmitral. Dilatación auricular izquierda. Insuficiencia mitral ligera-moderada. Insuficiencia aórtica ligera. VD de tamaño normal con buena contractilidad. IT moderada con PAPS estimada de 40-44 mm Hg.', 'Durante su estancia en sala la paciente evoluciona favorablemente tras tratamiento deplectivo y oxigenoterapia tolerando sedestación y deambulación. Presenta pico febril y hematuria y se detecta bacteriuria por lo que se inicia tratamiento antibiótico con cefuroxima. Dado que la paciente está estable y asintomática se decide alta con control por su Cardiólogo de zona y médico de cabecera.', 'INSUFICIENCIA CARDÍACA DESCOMPENSADA.', 'Cardiopatía isquémica crónica: stent convencional ADA media.\nInsuficiencia mitral ligera-moderada.\nInsuficiencia tricuspídea moderada.', '', '', 'Espironolactona 25 mg 50 comprimidos.\nZinnat \nPotasion\nSeguril\nAdiro', 'Control por su médico de cabecera y revisión de resultados de urinocultivo pendiente.\nSe le avisará de cita en 1-2 meses con su Cardiólogo de zona.'),
(45, '2008-02-11 00:00:00', '2008-02-08 00:00:00', '2008-02-11 00:00:00', NULL, NULL, NULL, 44, 65, NULL, 43, 5, 6, NULL, 8, 1, 1, NULL, 'Varón de 67 años de edad. Cuadro de tos con expectoración verdosa de dos semanas de evolución. Sensación febril no termometrada. Disnea progresiva en los últimos días.', 'DMNID,EPOC. No alergias medicamentosas conocidas.', NULL, 'Función cognitiva:Conservada\nFunción perceptiva: Conservada. Índice de Barthel:100\nSituación sociofamiliar:Normal.Buen apoyo familiar.\nConsciente y orientado, buen estado general,normohidratado y normocoloreado, apirético, ligera disnea de reposo, hemodinámicamente estable. Auscultación C-P:Tonos rítmicos. Roncus y sibilantes espiratorios diseminados.', 'Buena respuesta al tratamiento broncodilatador y corticoideo quedando el paciente eupneico. Control de las glucemias aumentando la dosis del ADO1', 'EPOC', 'Reagudización \nSobreinfección respiratoria', 'EKG\nRX TÓRAX', 'Theodur 200, 1 comp. 12 horas\n	Dieta diabética\n	Ingesta adecuada de líquidos.\n	Daonil 1-1-1\n	Control de glucemias capilares hasta ajustar dosis en relación con la corticoterapia corta.\n	Zamene 30, 1 comp. En el desayuno durante tres días\n	Disminuir posteriormente % de comp. Cada tres días hasta suspender.\n	Zantac 300, 1 comp. En la cena.\n	Ventolin 21HI 6h \n	Atrovent 4 INH/6h, ambas en la camara de Aerochamber.\n	Augmentine 875,1 comp 8h durante una semana.', 'Theodur 200, 1 comp. 12 horas\nDaonil 1-1-1\nZamene 30, 1 comp. En el desayuno durante tres días\nZantac 300, 1 comp. En la cena.\nVentolin 21HI 6h \nAtrovent 4 INH/6h, ambas en la camara de Aerochamber.\nAugmentine 875,1 comp 8h durante una semana.', 'Control de glucemias capilares hasta ajustar dosis en relación con la corticoterapia corta.\nDieta diabética\nIngesta adecuada de líquidos.'),
(46, '2019-11-29 00:00:00', '2009-09-12 00:00:00', '2009-09-18 00:00:00', NULL, NULL, NULL, 9, 89, NULL, 3, 1, 1, NULL, 6, 1, 1, 28, 'Paciente de 79 años que ingresa por un cuadro de pérdida de conciencia y presunción de valvulopatía aórtica no diagnosticada.', 'Fumador de un paquete al día.\nRepetidos episodios de AIT (en tratamiento con antiagregantes).', NULL, 'Consciente y orientado. \nAC: Rítmico, con soplo sisto-diastólico en foco aórtico y sistólico en foco mitral. \nAP: Limpia. \nAbdomen blando y depresible. \nSe palpan bien pulsos periféricos. \nActualmente no hay focalización de signos neurológicos.', 'Estabilización del cuadro clínico y tras realizar el estudio se descarta origen cardiológico de la perdida de conciencia. Está pendiente de terminar estudio neurológico por vía ambulatoria.', 'Doble lesión aórtica ligera moderada', 'Posible disglucosis', 'Ecocardiografía-Doppler: Estenosis aórtica ligera moderada. Hipertrofia concéntrica de predominio septal con ausencia de gradiente en reposo. Contractilidad segmentaria y FGS dentro de la normalidad (FE 60%)\nHolter: Salvas cortas autolimitadas de taquicardia auricular y ventricular. Asintomático durante toda la exploración.\nECG: Rimo sinusal. Crecimiento AI. Hipertrofia VI. Signos de isquemia en cara lateral.\nRx Tórax: Cardiomegalia con signos de HTP.\nTAC cerebral: No signos de isquemia ni de hemorragia. Imágenes de infartos antiguos.', NULL, 'Tromalyt 300 		 1 comp. en mitad de la comida\nIdaptan			 1 comp. cada 8 horas.\nTorecan		         1 comp. cada 12 horas\nRitmonar 150 		 1 comp. cada 12 horas\nDieta hiposódica \nControl de su disglicosis', 'Control por Médico de Cabecera y Especialistas habituales.'),
(47, NULL, '2010-10-04 00:00:00', '2010-10-11 00:00:00', NULL, NULL, NULL, 20, 90, NULL, 3, 7, 1, NULL, 6, 1, 1, 28, 'Hombre de 66 años de edad que ingresa por ESTÓMAGO DE RETENCIÓN procedente de\nUrgencias.', 'Fumador de 20 cig/día. \nIngesta enólico de 50 mgr al día. \nUlcus duodenal con perforación que requirió cirugía urgente hace 27 años. \nCirugía de cataratas hace 6 meses. \nDorsalgia crónica en tratamiento con paracetamol/tramadol. \nEstreñimiento crónico con toma de laxantes.', 'Desde hace una semana refiere sensación de plenitud y saciedad precoz postprandial, así como distensión en hemiabdomen superior, refiriendo en las últimas 24 horas vómitos de contenido alimenticio asociados a mareo y sudoración profusa sin pérdida de conocimiento. En los últimos dos meses, astenia, anorexia y pérdida de unos 5 kg de peso. Toma de ibuprofeno.', 'Peso 68.4 \nTalla 1.70 \nTA: 130//64. \nFC: 82. \nApirético. \nDeshidratación cutaneomucosa. \nPalidez cutaneomucosa. \nARC: normal. \nAbdomen: timpanismo en hemiabdomen superior con bazuqueo. No masas ni puntos dolorosos.', 'Se instauró tratamiento inicial con sonda nasogástrica con aspiración, reposición hidroelectrolítica y antisecretores. Tras la gastroscopia (8/10/10) descrita se reinició dieta, así como nutrición enteral con buena tolerancia. Ante ello es dado de alta debiendo acudir a control a C. Externas de Gastroenterología.', 'Ulcus duodenal', 'Estómago de retención\nEstenosis duodenal', 'A. urgente: destaca leu 8800, Hb 9.7, Hto 27.4%, VCM 71, HCM 25, plaq. 369000, glucemia 115, resto de hemograma, química y coagulación normales.\n\nRx abdomen: distensión gástrica con nivel hidroaéreo\n\n A. ordinaria: hemograma destaca: Hb 9.4, Hto 28%, VCM 77, JHCM 25, resto de hemograma normal. IQ 100%, fibrinógeno 5. Química destaca: Fe 16, ferritina 7, col 118, PT 5.7, albumina 3.3, lipasa 60, resto normal.\n\nTAC abdominal: Gran distensión gástrica con paredes del bulbo duodenal engrosadas de hasta 22 mm sugestivo de neoformación, apreciado cambio brusco de calibre en unión de 1ª y 2ª porción. Pequeñas imágenes nodulares hipodensas en lóbulo hepático izquierdo sugestivas de quiste. Quistes renales corticales bilaterales. Distensión vesical. Sin otras alteraciones.\n\nGastroscopia: ESÓFAGO: Línea Z e impronta diafragmática al mismo nivel (44 cm de arcada dental). No signos macroscópicos de esofagitis. Ascenso de restos alimenticios desde estómago. ESTÓMAGO: Abundantes restos alimenticios líquidos y semisólidos en cavidad gástrica, que impiden valorar fundus y parte de cuerpo gástrico. Curvatura menor de aspecto normal, en antro, se aprecia tumefacción prepilórica, asimétrica, con eritema difuso e irregular; su consistencia es blanda y no parece existir infiltración de planos profundos. DUODENO: En bulbo, se aprecia ulceración extensa en cara posterosuperior. Profunda, dura que ocasiona estenosis a ese nivel, fácilmente franqueable sin presión. La mucosa del bulbo duodenal también aparece edematizada, con áreas incluso pseudotumorales, pero de consistencia blanda y sin signos de infiltración; que alanza píloro y antro. Segunda porción duodenal de aspecto normal.', 'Dieta de protección gástrica sin fibra\nProhibición absoluta de aspirina y antiinflamatorios. En caso de dolor puede tomar paracetamol\nRecuerde que tiene usted la siguiente cita: El lunes 22 de noviembre de 2010 a las 12:00 horas: DR GASTROENTEROLOGÍA, ubicada en las Consultas Externas de este hospital, en PABELLÓN “D” – 1ª PLANTA – ENTRADA POR C/', 'FORTISIP: 3 envases al día\nAMOXICILINA 1 gr: 1cp. cada 12 horas durante 10 días.\nCLARITROMICINA DE 500 1cp. cada 12 horas\nANAGASTRA 40mgr: 1 cp. antes del desayuno, comida y cena.\nKILOR 80 mgr: 1 sobre al día. Se aconseja control de hemograma y Fe por médico de\ncabecera en un mes.', NULL),
(48, NULL, '2017-12-07 00:00:00', '2017-12-08 00:00:00', NULL, NULL, NULL, 16, 91, NULL, 3, 7, 1, NULL, 6, 1, 1, 28, 'Hombre de 19 años de edad que ingresa por ENF. COMÚN procedente de SERVICIO DEL PROPIO CENTRO-URGENCIAS CIRUGÍA', 'Neumotórax derecho a repetición. Se operó en otro centro hospitalario en el año 2016.', 'Neumotórax apical derecho de escasa magnitud que en la Rx de control ha mejorado.', NULL, 'Buena evolución', 'Neumotórax apical derecho', NULL, NULL, 'Reposo relativo.', 'Paracetamol 1 comp. vía oral si dolor', 'Acudir a consultas externas próximo miércoles 13 con Rx de tórax realizada previamente.'),
(49, NULL, '2014-09-30 00:00:00', '2014-10-06 00:00:00', NULL, NULL, NULL, 49, 71, NULL, 20, 13, 1, NULL, 1, 1, 2, NULL, 'Ingresa de forma programada desde HOSPITAL DIA para administración de 2º ciclo HYPERCVAD', 'No reacciones adversas medicamentosas conocidas\nNo hábitos tóxicos\nHipertensión arterial. No diabetes Mellitus ni dislipemia.\nIntervenciones quirúrgicas: implantes dentales\nDiagnosticado de LINFOMA PLASMABLASTICO ESTADIO IV-A. VIH-. Se inicia tratamiento con QT según Esquema de HyperCVAD completando 1er iclo entre eñ 08/09/2014 al 11/09/2014. Ingreso por neutropenia febril en aplasia 1er ciclo QT sin documentación microboilogica. Lleva Hickman.\nTratamiento Actual:\nALOPURINOL PENSA 300MG 30 COMPRIMIDOS EFG 1 COMPRIMIDO cada dia.\nCIPROFLOXACINO TAUCIP 500 MG 14 COMPRIMIDOS RECUBIERTOS CON PELICULA EFG 1 COMPIRIMIDO cada 12 horas durante 10 dias\nLORAZEPAM 1MG / 50 COMPRIMIDOS 1 COMPRIMIDO cada dia\nLACTULOSA 10000 MG / 50 SOBRES 1 SOBRE cada dia\nENALAPRIL 5 MG / 60 COMPRIMIDOS 1 COMPRIMIDO cada dia\nSEVREDOL 10MG 12 COMPRIMIDOS 1 COMPRIMIDO cada 4 horas\nMST 10 CONTINUS 10 MG 60 COMPRIMIDOS 1 COMPRIMIDO cada 12 horas\n\nSituación basal. Vive con su mujer.  Independiente para las ABVD', 'Ingresa de forma programa desde HOSPITAL DIA para administración de 2º ciclo HYPERCVAD.', 'BEG. C y O.  Hemodinamica correcta. Orofaringe normal. No signos inflamatorios locales CVC. ACP: Normal, Abdomen anodino. No palapación de ninguna masa de partes blandas presentes al diagnostico.', 'Se administra 2º Ciclo de HYPER-CVAD entre el 01/10/2014 al 4/10/2014 con buena tolerancia y sin complicaciones inmediatas. El 05/10/2014 se administra Neulasta. Tras finalizar el tratamiento el paciente puede ser dado de alta para seguir control de forma ambulatoria.', 'LINFOMA', 'LINFOMA PLASMABLASTICO ESTA IV-A\n2ºCICLO QUIMIOTERAPIA HYPER-CVAD', 'BIOQUÍMICA DE SANGRE\nHEMATÓLOGA GENERAL', NULL, 'CIPROFLOXACINO 500MG/12H VO\nFLUCONAZOLI 100MG/24H VO\nALOPURINOL 300MG 1C/24H VO\nENJUAGUE BUCAL CON COLUTORIO ANTISEPTICO DESPUÉS DE CADA COMIDA', 'Acudira al HOSPITAL DE DIA el proximo 14 de Octubre 2014 a las 08:00h para extración analitica urgente y control por Hematologia.\nSi FIEBRE acudir a URGENCIAS'),
(50, '2016-11-02 00:00:00', '2016-02-02 00:00:00', '2016-11-02 00:00:00', 0, NULL, NULL, 37, 117, NULL, 1, 1, 1, NULL, 1, 1, 1, 47, 'ITU', NULL, NULL, NULL, NULL, 'ITU', NULL, NULL, NULL, NULL, NULL),
(51, NULL, '2009-10-28 00:00:00', '2009-11-27 00:00:00', NULL, NULL, NULL, 1, 107, NULL, 4, 15, 1, NULL, 5, 1, 1, 38, 'Tumor cerebral', 'A.P: Hipertensión y cardiopatía. Prótesis cadera derecha.', 'HISTORIA CLÍNICA: paciente que ingresa de urgencia por clínica de epilepsia focal y presencia en los estudios de imagen de una lesión frontal izquierda. Refiere desde hace tres meses crisis de parestesias peribucales y torpeza en la mano derecha, con dificultad para hablar, transitorias y con recuperación completa y de diferente intensidad y duración. Había sido estudiado por el Serv. De BRL de Hospital, instaurando tratamiento anticomicial y antigregante, sin resultado aparente. Los estudios de topografía. Al ingreso el GCS es de 15p y no hay déficits. Se retira el tratamiento antiagragante y el paciente ingresa para completa estudio.\nEn la RNM que portaba al ingreso se aprecia una pequeña área de captación frontal rodeada de edema. En la RNM funcional preoperatoria esta zona ha aumentado, localizándose la zona motora próxima a la lesión. Los estudios de EEG muestran actividad lenta frontal de tipo lesivo. El estudio preoperatorio no contraindica la intervención. Durante el periodo preoperatorio el paciente sufre varias crisis, con independencia de los ajustes farmacológicos realizados por el Serv. De Neurología.\nI: el día 19/11/2009 es intervenido bajo anestesis general. Se localiza la lesión con estereotaxia, apreciándose en este momento una lesión de capración anular con necrosis intratumoral, de mayor tamaño que en los estudios previos. Se reaiza un craneotomía esterotáctica sobre el tumor, que aflora en superficie. Un EcoG preoperatorio uestra actividad lesiva. Se extirpa la lesión hasta tejido de aparencia sana con ayuda de aspirador ultrasónico.\nE: la intervención y el postoperatorio transcurren sin complicaciones. Sin embargo, a los pocos días se produce una crisis parcial motora que se sigue de una disartria persistente. Un estudio de TAC excluye sangrado y los niveles de antipilépticos son adecuados. La RNM postoperatoria no muestra restos tumorales en el techo, pero identifica un pequeño nódulo frontal contralateral de captación.\nH.: GLIOBLASTOMA', NULL, NULL, 'D.P: GLIOBLASTOMA FRONTAL IZQUIERDO', 'O.P.: EPILEPSIA FOCAL', 'P.Q.: CRANEOTOMÍA ESTEROTÁCTICA ELECTROCORTICOGRAFIA Y EXEREISIS DE TUMOR CEREBRAL', NULL, NULL, 'R.E.:\n- Seguir las recomendaciones dadas en el momento del alta\n- Acudir a Consultas de Radioterapia del Hospital cuando sea citado\n- revisión en Consultas Externas de Neurología, el día 05/02/2010 a las 9,40'),
(52, NULL, '2019-04-20 00:00:00', '2019-05-02 00:00:00', NULL, NULL, NULL, 1, 108, NULL, 36, 5, 1, NULL, 5, 1, 1, 38, 'Ingresa por ENF.COMÚN procedente de ATENCIÓN PRIMARIA', 'No RAM/ la paciente refiere alergia a penicilina que resultó negativa en pruebas de alergia realizadas en el Hospital, pero no puedo corroborar dicha información al no disponer del informe de recomendaciones ni de pruebas cutáneas realizadas.\n-HTA\nANTECEDENTES RESPIRATORIOS:\n-Asma bronquial moderada persistente en seguimiento en el Hospital )no disponemos de historia clínica)\n-SAHS en tratamiento con CPAP a 8 cm H2O\n-Un ingreso en 2017 (Hospital) por NAC neumococica en UCI\n-Bronquiectasias con varios episodios de hemoptisis franca hace años\nSOCIAL:\n-Independiente para las actividades de la vida diaria, vive sola.\nANTECEDENTES MÉDICO-QX:\n-Quirúrgicos: CST, malla pared abdominal\n-Gineco-obstétricos:\n   - MP 46 años\n   - G5 P3 C1 A1\n- Vulvectomía y linfadenectomía inguinal bilateral el 21/03/2019 por neoplasia de vulva. Próxima visita el 24-04-2019 para valoración tras al alta.\nTTO ACTUAL:\n-TELMISARTAN SANDOZ 40 MG 28 COMPRIMIDOS EFG\n-ALDACTONE 25 MG 50 COMPRIMIDOS RECUBIERTOS PELICULA\n-SINGULAIR 10 MG 28 COMPRIMIDOS RECUBIERTOS CON PELICULA\n-DALPARAN 10 MG 30 COMPRIMIDOS RECUBIERTO CON PELICULA\n-MIANSERINA 10 MG/50 COMPRIMIDOS\n-DOBUPAL RETARS 150 MG 30 CÁPSULAS CURAS LIB PROLON\n-FOSTER NEXTHALER 100/6MCG/INHANALACIÓN 1 INHAL 120 DOSIS POLVO INHALC.\n-SPIRIVA RESPIMAT 2,5 MCG 60 PULSACIONES (30 DOSIS) 1 INH+1CART SOL INHAL.\n-PARACETAMOL 1000 MG/40 COMPRIMIDOS\n-OMEPRAZOL 20 MG/28 CAPSULAS', 'Enfermedad actual:\nPaciente de sexo femenino de 84 años que acude desde ATENCION PRIMARIA por motivo ENF.COMÚN. Mujer de 84 años de edad que acude por presentar ton con expectoración de coloración verdosa de 2 días de evolución acompañada de aumento de la disnea y disminución de la diuresis desde ayer. Ha presentado sensación distérmica sin fiebre termometrada. Dolor de características pleuríticas sobre hemitórax derecho.', 'Exploración física:\nEN PU:\nConstantes vitales: 20-04-2019 14:33 – TA: 112/59 mmHg; FC: 98 lat/min (Rítmica); Tª: 36,4ºC (Axilar); Sat. O2: 93% (Sin oxigeno); \n20-04-2019 13:59 – TA: 100/65 mmHg; FC: 101 lat/min (Rítmica); Sat. O2: 92% (Sin oxigeno).\n-Buen estado general. Coloración e hidratación adecuadas.\n-Consciente y orientada con lenguaje conservado. No hay evidencia de focalidad neurológica.\n-Disneica en reposo.\n-AC: Semiología de broncoespasmo\n-Abdomen: blando y depresible, no doloroso a la palpación, sin signos de irritación peritoneal y sin evidencia de visceromegalias ni masa. Ruidos hidro-aéreos normales. Singo de Blumberg negativo. Signo de Murphy negativo.\n-Zona vulvar edematizada con algunos puntos de sutura reabsorbibles.\n-Extremidades inferiores sin edemas\nEN SALA DE NEUMOLOGÍA:\nTA 132/78, apirética, 89 ppm, 28 rep/min, sat 95% con O2 a 1,5 L/min\nRegular estado general, disnea en reposo que a veces interrumpe el habla\nAC: rítmica sin soplos\nAP (plano anterior): crepitantes basales derechos, no semiología de broncoespasmo.\nAbdomen: ligeramente doloroso a la palpación profunda en hipocondrio derecho, sin signos de peritonismo.\nNo edemas en MMII', 'Evolución:\nEvolución lenta pero favorable. No ha presentado complicaciones respiratorias ni cardiovasculares. No ha presentado agudización del asma. La función renal ha estado oscilante dependiente de la fluidoterapia IV. Al alta FG 48 mL/min. Se ha corregido la leucocitosis y la PCR ha disminuido a 24 mg/L.\nDurante su ingreso se ha valorado por Oncoginecología.\nEstable, se procede a su alta hospitalaria siendo la saturación respirando aire ambiente de 94%.', 'NEUMONIA NEUMOCOCICA', 'NEUMONÍA POR ESTREPTOCOCO NEUMONIAE\nASMA\nSAOS\nNEOPLASIA DE VULVA\nINSUFICIENCIA RENAL', NULL, '', 'CEFDITORENO 200 MG. 1 COMPRIMIDO cada 12 horas durante 3 días\n-LEVOFLOXACINO 500 MG. 1 COMPRIMIDO cada 2 días durante 4 días.\n- RESTO DE SU TRATAMIENTO TAL COMO LO ESTABA LLEVANDO ANTES DE SU INGRESO HOSPITALARIO.\n- SE RECOMIENDA HIDRATACIÓN ABUNDANTE', 'Recuerde que tiene usted la/s siguiente cita/s:\nEl viernes 03 de mayo de 2019 a las 12:30: AGENDA DE ONCOLOGÍA; ubicada en Ginecología\nSEGUIMIENTO DE LA NEUMONÍA CON RADIOGRAFÍA DE TÓRAX POR NEUMÓLOGO DE ZONA EN EL PLAZO DE 3-4 SEMANAS\nSEGUIMIENTO DE LA FUNCIÓN RENAL POR MAP'),
(53, NULL, '2014-09-12 00:00:00', '2014-09-12 00:00:00', 20452514, NULL, NULL, 5, 53, NULL, 3, 7, 6, NULL, 8, 1, 1, 32, 'Biopsia en muslo derecho, dice que se le ha soltado un punto.', 'No reacciones adversas medicamentosas conocidas.\nNo hábitos tóxicos.\nHipertensión arterial. No diabetes mellitus ni dislipemia. \n\nIntervenciones quirúrgicas: implantes dentales.\n\nTratamiento habitual: enalapril 20 mg al día. MST continus cada 12 horas.\n\nVive con su mujer. Independiente para ABVD.\nTrabaja de camionero.', 'Varón de 63 años que acude por dehiscencia de los puntos de biopsia en cara interna muslo derecho. La biopsia se la hicieron el día 03/09/2014. No refiere fiebre.', 'En cara interna de muslo derecho se observa herida antigua de unos 3 cm, abierta en su parte medial unos 2 cm. No signos inflamatorios.', 'Se coloca punto de aproximación de bordes con Monofilamento 4/0 y se colocan Steri-Streep.', 'DEHISCENCIA HERIDA', NULL, NULL, 'No requiere', NULL, 'Lavado diario de la herida con agua y jabón. Posteriormente, pintar con Betadine. \nAcudir en 10 días a su Centro de Salud para retirada de punto.\nSi empeoramiento o aparición de nueva sintomatología, volver a puertas de urgencias.'),
(54, NULL, '2008-08-12 00:00:00', '2008-08-14 00:00:00', NULL, NULL, NULL, 2, 93, NULL, 25, 11, 6, NULL, 2, 8, 1, 31, 'Procedente de quirófano de PU donde se interviene de sangrado cervical por autoagresión (según consta en HªC) realizándose hemostasia de vasos superficiales (sin objetivarse lesión de grandes vasos). Ha requerido transfusión de 4 CH', 'NO RAM: Tto antidepresivo. Hábito enólico (según anamnesis a familiares)', 'Ingresa bajo los efectos de la Anestesia General, estable hemodinamicamente, extubándose al día siguiente del ingreso.\nEvolución favorable. Consciente, desorientado temporo-espacialmente variable, con habla sin déficits, moviliza 4 extremidades y conexión con familiares, con respuesta a órdenes sencillas. Parámetros cardiorrespiratorios normales. Ctes mantenidas. Apirético, eupneico, manteniendo sat 02 98% con Ventimask al 40%. No nuevos episodios de sangrado.\nInicia periodos alterantes de agitación psicomotriz. Se revisa por psiquiatría de guardia, pautando tratamiento. Control analítico: Hto: 33%, diuresis aceptable.\nDada la evolución del paciente se decide su paso a planta para control y seguimiento. REALIZAR NUEVA INTERCONSULTA A PSIQUIATRIA PARA CONTROL EVOLUTIVO.', NULL, NULL, 'LESIÓN REGIÓN CERVICAL DE HERIDA DE ARMA BLANCA', 'INTENTO DE AUTOLISIS', 'REVISIÓN HERIDA + HEMOSTASIA', 'POSICIÓN SEMIINCORPORADA Y CABEZA NEUTRA', 'SF 2000 ML/24H\n-PANTOPRAZOL 40MG/24H\n-NOLOTIL 1 AM+ 100 SF/8H\n-AUGMENTINE 1 GR/8H\n-HALOPERIDOL 1 AMP + 100 SF/8H\n-OXIGENO EN GAFAS NASALES A 2L/MIN\n-CONTROL DE HTO Y CTES', NULL),
(55, NULL, '2014-02-09 00:00:00', '2019-12-11 00:00:00', 0, NULL, NULL, 49, 72, NULL, 43, 15, 1, NULL, 2, 1, 1, NULL, 'Paciente que ingresa por LINFOMA PLASMABLASTICO procedente de HOSPITAL DE DIA', 'No reacciones adversas medicamentosas conocidas\nNo habitos toxicos\nHTA\nNo diabetes mellitus ni dislipemia\nIntervenciones quirurgicas: implantes dentales\nTratamiento actual: enalapril 20mg al dia\nVive con su marido. Independiente para las ABVD\nTrabaja como camionera', 'Durante dicho ingreso tuvo mal control del dolor con analgesia habitual (paracetamol, nolotil y enantyum) escalando con tramadol y posteriormente morfina de liberación retardada hasta conseguir buen control de la sintomatologia. Se disminuyeron dosis de antihipertensivo al alta por presentar cifras bajas de tensión arterial.\nDesde el alta refiere estreñimiento (sin uso de laxantes) y problemas para conciliar el sueño. Dolor con control regular (morfina de liberación retardada 10 mg / 12 h. precisando 1 rescate de morfina 10 mg sobre las 6 horas de cada pastilla).\nTras ser diagnostico de linfoma plasmablastico se remite desde CCEE M. interna a Hospital de Dia, valoracion urgente por Hematologia. Se decide ingreso para acelerar pruebas complementarias e inicio Quimioterapia.', NULL, NULL, 'LINFOMA', 'LINFOMA PALSMABLASTICO ESTADIA IV-A\n1ER CICLO QUIMIOTERAPIA HyperCVAD\nESTREÑIMIENTO', 'ANALÍTICA 22/08/14\nBIOQUIMICA SANGRE\nPROTEINOGRAMA\nPROTEINAS ESPECIFICAS\nINMUNOLOGIA-ALERGIAS\nHEMATOLOGIA GENERAL\nANALITICA 25/08/14\nDiuresis\nTAC T-A-P 20/08/14\nTC de torax: Masas paravertebrales a mivel de T8 Y T12-L1 que contactan con superficie vertebral y que en bordes lobulados.\nMasa intercostal de 59 mm a nivel de cuarto arco costal izquierdo respetando la cortical con extensión por espacios intercostales adyacentes. Nódulo de 13 mm en tejido celular subcutáneo de vertiente derecha de pared torácica.\nSe observan nódulos pulmonares, uno en pulmón izquierdo, de 14 ,, y otro en LSI, que asienta sobre cisura mayor, de 4 mm.\nTC de abdomen: masa suprarrenal izquierda de 102 mm de morfología irregular y realce heterogéneo que infiltra riñón izquierdo, bazo, páncreas, vena renal izquierda y vena esplenica, que dado su comportamiento diferencial respecto al resto de masas mencionados podría tratarse de un tumor primario.\nMúltiples nódulos y masa retroperitoneales, pelvicos (uno de ellos crece hacia agujero de conjunción anterior saco) y musculares localizados en grasa properitoneal, pared abdominal, en cadena iliaca interna, musculo psoas izquierdo, musculo glúteo mayor derecho, musculo gluteo menos izquierdo y musculo gluteo mayor izquierdo.\nLa mayor parte de las lesiones son de comportamiento hipervascular.\nConclusión: Múltiples lesiones de partes blandas torácicas y abdominales y masa suprarrenal izquierda que plantean la posibilidad diagnostica de carcinoma o sarcoma de glándula suprarrenal izquierda con metástasis múltiples o bien metástasis múltiples de primario no visualizado. Es menos probable que se trate que se trate de comportamiento atípico de linfoma.\nANATOMÍA PATOLÓGICA\nDescripción Macroscópica: Dos lesiones nodulares de 2,5 x 2 y 1 x 1,5 cm. Al corte el fragmento de mayor tamaño presencia de tejido fibroso blanquecino de aspecto carnoso. El fragmento de menor tamaño en bloque 1. I. P. 3 bloques.\nDescripción Microscópica: Ambas muestras corresponden a tejido tumoral de alta densidad celular de hábito hematolinfoide. Están compuestos por células de talla variable, algunas grandes pero predominantemente intermedia y/o pequeña, presentan moderado citoplasma granular eosinófilo, y con frecuencia muestran diferenciación plasmocitica (lateralización nuclear y cromatina grosera en rueda de carro). El indice mitótico es alto y la actividad proliferativa expresada por el marcador Ki67 es mayor 90%. Con tecnicas de inmunohistoquimica las celulas presentan un inmunofenotipo concordante con la diferenciación plamocitica mencionada: positividad para vimentina, C45 (LCA), EMA, MUM1, OCT-2, y monotipicas para cadenas ligeras lambda; siendo negativas para marcadores epiteliales (citoquetatinas), neuroendocrinos (cromogranina, sinaptofisina, enolasa y CD56), melanicos (S100, HMB 45 y Melan A) de linfocitos B (CD20, CD10, Bcl2, Bcl6 y PAX5; positividad focal para CD79a), T (CD3, TdT, CD5)  y mieloperoxidasa. No se observa positividad para marcadores virales (EBV y HHV-8)\nDiagnostico: NODULO PARA AREOLAR IZQUIERDO; ESCISIÓN-BIOPSIA: INFILTRACIÓN POR NEOPLASIA\nPLASMABLASTICA CONCORDANTE CON LINFOMA PLASMABLASTICO VS PLASMOCITOMA/MIELOMA PLASMABLASTICO.\nComentario: se trata de un tipo agresivo y poco frecuente de linfoma inusual forma de presentación (paciente inmunocompetente con afectación de tejidos blandos). Aunque el CD138 es negativo, el perfil inmunofenotipico de este tipo de linfomas es altamente varible.\nMEDULOGRAMA 5/9/2014\nNo se obejtiva infiltración Medular\nBIOPSIA Medula Ósea: No se objetiva infiltración.\nECOCARDIOGRAFIA\nCavidades derechas no dilatadas. Ventrículo derecho con buena función sistólica, TAPSE:22mm. Aurícula izquierda de tamaño normal (36 mm). Raiz aortica normal (30 mm). Ventrículo izquierdo de diámetros dentro de la normalidad, sin alteraciones de la contractibilidad segmentaria y con buena función sistolica del mismo globalmente considerada. Válvula aortica trivalva con buena apertura y sin flujos patológicos. Válvula mitral trivalva con buena apertura y sin flujos patológicos. Válvula mitral de morfología normal, con buena apertura y sin flujos patológicos. Patrón de llenado transmitral EA. Insuficiencia tricúspide mínima que permite estimar estimar una PsAP de25 mmHg. VCI no dilatada, con adecuado colapso insipiratorio. No derrame pericárdico. \nESPIROMETRIA 10/09/2014\nPatrón restrictivo ligero, FVC 2.83 (76 %) FEV1/FVC 77, Mesoesp. 57 %\nRX TORAX 12/08/2014\nAumento del derrame pleural izquierdo respecto a ultima exploración previa, con aumento del tamaño de la masa extrapulmonar en hemitorax izquierdo conocida. Via venosa de doble luz con extremo distal en vena cava superior.', NULL, 'ALOPURINOL 300 MG 1C/24H VO\nCIPROFLOXACINO 500 MG/24H VO\nDieta pobre en contenido bacteriano\nEnjuagues bucales con colutorio antiséptico después de cada comida\nResto medicación sin cambios', 'Acudirá al Hospital de día el próximo 18/09/2014 para extracción analítica urgente y valoración por Hematologia. Si fiebre acudir a  urgencias.');
INSERT INTO `episodio` (`id`, `fecha_firma`, `fecha_inicio`, `fecha_alta`, `importe`, `finalizado`, `bloqueado`, `id_servicio`, `id_paciente`, `id_factura`, `id_dependencia`, `id_medico`, `id_tipoepisodio`, `id_episodio`, `id_circunstanciasalta`, `id_destinoalta`, `id_modalidadepisodio`, `id_usuario`, `motivo_ingreso`, `antecedentes`, `historia_actual`, `exploracion_fisica`, `evolucion_comentarios`, `diagnostico_principal`, `diagnostico_secundarios`, `procedimientos`, `tratamiento_recomendaciones`, `tratamiento_farmacos`, `recomendaciones`) VALUES
(56, '2019-12-04 00:00:00', '2001-08-27 00:00:00', '2001-08-31 00:00:00', NULL, NULL, NULL, 41, 123, NULL, 3, 7, 1, NULL, 6, 1, 1, 28, 'Paciente varón de 54 años que ingresa procedente de urgencias por presentar cuadro de náuseas, vómitos y sudoración fría asociado a opresión torácica, así como dolor cólico en dosa ilíaca izquierda, empeorando tras una cafinitrina sl y cediendo finalmente tras nueva cafinitrina sl.', 'No alergias medicamentosas conocidas. Hipertensión arterial en tratamiento con nifepidino retard y enakaoril con irregular control. Dislipemia en tratamiento dietético. No diabetes; no tabaquismo. Ingreso en abril del 99 por IAM no Q (pico CPK 457/47). Desde entonces asintomático. Ergometría en junio del 99 negativa para isquemia.', '', 'Buen estado general, consciente y orientado. Eupneico en reposo. TA 150/100. AC: tonos rítmicos a 56 lpm, soplo sistólico 1/6 en borde esternal izquierdo y foco aórtico. AP: normal. Buena perfusión distal. No edemas en mmii.', 'En las primeras 48 horas persiste dolor cólico en fosa ilíaca izquierda que se resuelve con tratamiento analgésico. Ante la ausencia de hallazgos clínicos, bioquímicos y electrocardiográficos sugestivos de isquemia miocárdica, se interpreta el cuadro como secundario a patología nefrourológica por lo que se procede al alta con control por Urólogo de área.', 'Cólico nefrítico izquierdo', 'Hipertensión arterial\nCardiopatía isquémica crónica', 'ECG: ritmo sinusal. T negativa en DDII y aplanada en aVF y V6\nRC TÓRAX: borramiento de los hilos, aumento de marcas en bases\nBIOQUÍMICA: Urea 57, Creatinina 0.98, Na 140, K 3.68, CPK 111 (MB 15), troponina T negativa.\nColesterol total 147 HDL 44, LDL 81, TG 110\nHEMOGRAMA: Hb 14.6, Hcto 42.6%, 9300 leucocitos (93.8% neutrófilos), 179000 plaquetas\nCONGULACIÓN: normal\nSEDIMENTO ORINA: normal\nECOGRAFÍA ABDOMINAL: sin hallazgos patológicos.\nECOCARDIOGRAMA: Grosor de paredes de VI en el límite superior con diámetros y función global sistólica conservados. Ausencia de alteraciones significativas de la contractilidad segmentaria en reposo. Patrón de llenado de VI normal. Sin cambios respecto a exploración de 1999.\nERGOMETRÍA: prueba submáxima negativa para isquemia miocárdica, con muy buena capacidad funcional (14 METS)', 'Ingesta hídrica  abundante, Dieta pobre en sal y grasas animales', 'TENORMIN 10 1 comprimido en desayuno.\nAAS 100 2 comprimidos en comida\nLIPLAT 20 1 comprimido en cena\nNOLOTIL 1 comprimido cada 8 horas si dolor cólico.', NULL),
(57, NULL, '2014-03-08 00:00:00', '2014-03-09 00:00:00', 0, NULL, NULL, 37, 113, NULL, 3, 7, 1, NULL, 9, 1, 1, 41, 'Mujer de 86 años, remitida a urgencias con imposibilidad por bajo nivel de consciencia. Los familiares refieren debilidad de MMII de 24 horas de evolución con incapacidad para la bipedestación.\nDiagnosticada hace 3 días de ITU e ICC\nEn tratamiento actualmente de; Augmentine, Seguril y Paracetamol\nSegún familiares buena Diuresis, no semiología respiración no ortopnea', 'No RAM conocidas, HTA, FA, ICC.\nDM tipo 2\nAnemia crónica\nCirugía de cataratas\nTratamiento habitual de; Emconcor 5, Sintrom, Captopril, Insulina y Ferogradument.', NULL, 'Buen estado nutricional, 26 rpm con aumento del trabajo respiratorio, cy c : IVY,\n AC: tonos arrítmicos a 120 lpm, \nAP: crepitantes en ambas bases del predominio izquierdo\nAbd: globuloso, hepatomegalia de 5 cm \nEEII: edemas blandos\nMúltiples hematomas en todos los territorios.\nAnisocoria: pupila izquierda excéntrica y algo más midriática.\nExploración Neurológica: no signos meníngeos.', 'La paciente ingreso con síndrome séptico, fibrilación auricular rápida a 150 l/min e insuficiencia renal grave.\nHa precisado dosis altas de diuréticos y albúmina para la disminución de los edemas, secundariamente hiponadremia que ha indicado restricción hídrica a 1 L/dia. \nAl alta: ura 172, creatinina 2,30, Na 134, K 5.1 , Hb 9.2, leucocitos 4600, plaquetas 92000. Al alta rítmica a 92 l/min.', 'BACTERIEMIA POR STAPHYLOCOCCUS AUREUS, SEPSIS GRAVE.', 'Infección urinaria por K.Pneumoniae, insuficiencia renal crónica agudizada.\nInsuficiencia cardiaca, hepatopatía crónica VHC+ , descoagulada, Neumonía LII , Hipertensión arterial, Diabetes Mellitus tipo, Candiduria.', 'ECG: AC * FA, BCRDHH, ECOCARDIOGRAFIA: Insuficiencia aórtica ligera, VI de volúmenes y función global sistólica conservada, sin alteraciones de contractilidad en reposo, ligera dilatación aurícula izquierda, insuficiencia tricúspide ligera-moderada asociada a HTP ligera (PAP sist 45 mm Hg)\nRX TÓRAX: cardiomegalia, aumento de densidad en base y borramiento silueta cardiaca izquierda-\nECOGRAFIA ABDOMINAL: hipertrofia LHI y caudado, bordes poliglobulados compatible con hepatopatía crónica, no LOEs , eje espienoportal normal, pero con flujos disminuidos.\nNo circulación coletral\nModerada ascitis\nVía biliar normal\nNo esplenomegalia.', NULL, NULL, NULL),
(58, NULL, '2017-08-02 00:00:00', '2017-08-06 00:00:00', 0, NULL, NULL, 70, 11, NULL, 26, 5, 1, NULL, 6, 1, 1, 18, 'Mujer de 52 años que ingresa por ENF. COMÚN procedente de PARTICULAR', 'No RAM conocidas. \nAntecedentes médico-quirúrgicos sin interés.\n\nTratamiento:\nCefuroxima 500 mg cada 12 horas 14 días.\nParacetamol 1 gr cada 8 horas.\nNolotil 1 caps entre toma de paracetamol.', 'Mujer de 52 años dada de alta hace 2 horas de Observación por pielonefritis aguda derecha febril 2º a E. coli en urinocultivo tras tratamiento con ceftriaxona iv + cefuroxima oral en domicilio, que acude por nuevo pico febril con Tº: 39ºc y persistencia del dolor en fosa renal derecha.', 'El 02-08-2017 18:03 - TX: 39 °C (Bucal): TA: 133/88 mmHg; FC: 89 atmin (Rítmica) Sat 02: 100% (Sin Oxigeno).\nBEG NH NC eupneica.\nAbdomen: blando depresible, doloroso en fosa renal derecha no peritonismo percusión renal derecha positiva.', 'La evolución en sala de hospitalización es satisfactoria, con remisión paulatina de la fiebre y tendencia a la normalización de los parámetros analíticos. Clinicamente la paciente experimenta mejoría importante con tolerancia oral positiva y disminución del dolor. Por todo ello se procede al alta domiciliaria para continuar tratamiento antibiótico vía oral y posterior control por médico de cabecera.', 'PIELONEFRITIS AGUDA', NULL, 'Afectacion de nou direcio AL INGRESO 1 de agosto 2017 CULTIVO DE ORINA Escherichia coli 100.000 UFC/mi \nBIOQUIMICA EN SANGRE GLUCOSA 108 mg/dL UREA 24 mg/dL CREATININA 0,74 mg/dL FILTRADO GLOMERULAR (CKD-EPI) 93 ml/min Valor compatible con normalidad. Estimación del FG, cebe valorarse junto al contexto clinico del paciente PROTEINA C REACTIVA 129,8 mg/L CLORO 103 mEq/L, SODIO 142 mEq/L POTASIO 3,8 mEq/L BIOQUIMICA EN SANGRE INDICE ICTERICO 0,29 mg/dL \nHEMATOLOGIA HEMOGRAMA SERIE ROJA HEMATIES 4,17 x 10^6/UL HEMOGLOBINA 12.0 g/dL HEMATOCRITO 36,9 % VOLUMEN CORPUSCULAR MEDIO 89 FL HBG CORPUSCULAR MEDIA 28.8.\nCONC. HBG CORPUSCULAR MEDIA