(59, NULL, '2015-04-27 00:00:00', '2015-10-05 00:00:00', 0, NULL, NULL, 29, 58, NULL, 3, 6, 1, NULL, 1, 1, 1, 37, 'Hombre de 64 años de edad que ingresa por ENF.COMÚN.', 'DM tipo II\nSdme depresivo\nVasculitis cutánea y gammapatia monoclonal benigna controlado en Htal La Fe\nInsuficiencia renal crónica multifactorial transfundida en varias ocasiones y tratada con ferroterapia.\nHepatopatía crónica por VHC.\nITUs de repetición.\nIQ Fx radio distal y ramas púbica (reducción y osteosíntesis en Enero 2009).', 'Tratamiento actual amlodpino. 1-0-0 Aproda 10-10-10.  Dezacor  6 mg. Emconcor cor 1-0-0, Lantus 0-0-34 Prandin 1 mg 1-0-1 seguril 1-0-0, Somazina, Tarjenta 1-0-0\nPaciente de sexo Femenino de 76 años que acude desde SERVICIO DEL PROPIO CENTRO por el motivo ENF.COMUN           \nMujer 76 años que acude a PU remitida desde CAp para valoración por Cirugia general de ulcera vasculares en MID de años de evolución con empeoramiento el último mes y evolución tórpida apenas puede descansar por la noche\nNo fiebre\nNo trauma aprevio\nEn tratamiento desde hoy con Ciprofloxacrino', 'REG: Palidez cutánea NH COC                                                                                                                  \n PA: 180/109mmHg FC107 lpm Sat 02 99% Tª36.3C GD mg/dl                                                                                            \n AC: rítmica                                                                                                                                                        \n AP: roncus aislados                                                                                                                                           \n MMI sin edemas, mejoría de las úlceras en ambos MMII         \n\nRx Tórax: Cardiomegalia. Calcificación de anillo valvular cardiaco. Probables pequeñas bronquiectasias en bases. \nAnalítica al ingreso\nHematíes(urg);4.26x10s12/l; Hemoglobina\nurg):10.40 g/dl; Hematocrito (urg) 24.50pg; Concentración hemoglobina corpuscular media (urg):31.80 g/dl; Ancho distribución eritrocitos(urg) 19.60%; Leucocitos (urg):15.40 x10s9/l; Neutrofilos (urg):94.00%; Linfocitos (urg):2.70%; Monocitos (urg):3.30%; Eosinofilos (urg): 0.00% Basofilos (urg):0.00%; Neutrofilos absolutos(urg):14.45x10s9/l Linfocitos absolutos (urg): 0.01x10s9/l; Monocitos absolutos(urg): 0.51x10s9/i; Eosinofilos absolutos (urg): 0.01x10s9/l; Basofilos absolutos (urg):0.51x10s9/l; Plaquetas (urg): 275.00x10s9/l; Volumen plaquetar medio (urg);7.50 fl; \nCOAGULACIÓN: coagulación estándar (urgente):Tiempo protrombian(urg): 10.7 seg; Indice de quick (urg): 100%; T protombina ratio (inr) (urg):0.97 inr; Fibrinógeno (urg); 500 mg/dl\nGASOMETRIA VENOSA: Gasometria venosa(urgencias): Ácido láctico (venoso): 3.20 mmol/l; Ph(venoso);7.48co2 (venoso):32.70mmhg, Po2 (venoso):23.20 mmhg; Co3h(venoso)24.10 meq/l; Co2 total (venoso): 25.10mmo/l; E.b(venoso); 1.40 mmol/l; E.b.s (venoso):0.90 mmol/l, B.c.s (venoso):24.50 meq/l; Saturación hb (venoso):36.0%\nBIOQUIMICA:Glucosa:211 mg/dl; Urea:116 mg/dl; Creatinina 1.8mg/dl Sodio: 140 meq/l; Potasio 4.3 meq/l Ck total; 32 mu/ml\nAnalítica  al alta\nHematies: 3.52x10s12/l; Hemoglobina:9.1 g/dl; Hematocrito:28.4%; Volumen corpuscular medio:8.8fl; Hemoglobina corpuscular media:26.0 pg: Concentración hemoglobina corpuscular media:32.1 g/dl; Ancho distribución eritrocitos:23.0%: Leucocitos; 6.5 x10s9/l; Plaquetas: 180x10s9/l; Volumen plaquetar medio; 7.4fl;5.9 Beta 2 globulina(%); Gamma globulina(%): 15.2%; Cociente alb/glob:1.09\nELECTROFORESIS DE PROTEÍNAS SÉRICAS:Componentes monoclonal:0.38 g/dl; Componente monoclonal % 7.1%\nORINAS: Sedimento y anormales (programada):Densidad:1.012Bilirrubina:0.0 mg/dl: Cuerpos cetónicos: 0 mg/dl; Glucosa:0 mg/dl; Hemoglobina;0.00 mg/dl; Proteínas:0 mg/dl; Reacción:(ph):5.0Urobilinogeno:0.2mg/dl; Sedimento: sin hallazgos patológicos.\nRM Vascular MMII: Permeabilidad de \naorta abdominal, así como también de los vasos ilíacos comunes, interno y externo de ambos lados, con mínima estenosis focal en el art iliaca externa derecha. Arterias femorales comunes permeables, identificando focos de estenosis en el tercio medio de las femoral superficial izquierda pero no significativo ya que permiten el paso de contraste hasta las vertientes más distales La arteria femoral superficial derecha presenta un calibre mucho menor con presencia de múltiples focos estenóticos y área de defecto de repleción de aproximadamente unos 34 mm en el tercio medio de la misma.\nArterias poplíteas permeables.    \nEn la pierna derecha se aprecia permeabilidad del tronco tibio peroneo y arteria tibial anterior así como también peronea y tibial posterior, aunque mostrando todos estos vasos pequeñas estenosis focales de muy pequeño tamaño no significativas. En la pierna izquierda se observa permeabilidad del tronco tibio peroneo y posterior que presenta pequeños focos de estenosis en su tercio proximal no significativos. Falta de repetición de arteria tibial anterior izquierda, observando tan sólo una pequeña porción de la misma arrosariada en su inicio. Los hallazgos referidos son compatibles con patología arteriosclerótica multinivel.\nRx Tórax: Cardiomegalia con elongación aórtica sin otros hallazgos.', 'La paciente mejora progresivamente de las úlceras de MMII. Tuvo un cuadro de acidosis metabólica  en el contexto de una descompensación de su patología de base. Se curan las úlceras vasculares y se cita para control en CCEE  de úlceras vasculares con el Dr.Flores.', 'ULCERA VASCULAR', 'HTA \nDM\nINSUFICIENCIA RENAL CRÓNICA\nVASCULITIS CUTANEA\nHEPATOPATIA VHC', NULL, 'Continuar con su tratamiento habitual                                                                                                     \nAñadir levofloxacino 250 mg cada 24 horas durante 10 días.      \n\nSe administran 5 comprimidos de levofloxacino 500 mg ya que no se puede prescribir procedimientos técnicos. Se deberá tomar medio comprimido al dia.', NULL, 'Se adjuntan recomendaciones para prevención de úlceras vasculares.'),
(60, NULL, '2019-12-04 00:00:00', '2019-12-27 00:00:00', NULL, NULL, NULL, 1, 104, NULL, 1, 1, 1, NULL, 1, 1, 1, 37, 'Hombre de 64 años de edad que ingresa por ENF.COMÚN.', 'No alergias medicamentos conocidos.\nNo hábitos tóxicos.\nDislipenia.\n\nTratamiento de primera línea (septiembre 2014): HyperCVAD x 4 ciclos\n-	Respuesta a la primera línea (24/12/2014) 1ª remisión metabólica (PET-TAC)\n-	Consolidación TASPE (día 0: 14/01/2015) por lesiones extranodales que causan compresión medular y déficit neurológico. Se realiza el 24/06/2015 punción de la lesión a nivel de L1-L2 sin complicaciones inmediatas, pero sin rendimiento diagnóstico.\n-	Tratamiento de segunda línea (junio 2015): RADIOTERAPIA urgente (22 al 26/06/2015) sobre campo efecto y se  administra un primer y único ciclo de QT según esquema CHOP. No se objetiva mejoría de la exploración neurológica hasta el 28/06/2018 fecha a partir de la cual inicia recuperación de déficit neurológico en MMSS Y recupera sensibilidad en MMII izquierdo, no mejoría de déficit en MMII Izquierdo ya presente al ingreso (plejia MMII Izquierdo.)\nEn 13/07/2015 iniciar 1er ciclo de R-ESHAP. Se ha administrado un total de 2 ciclos, 20 6.8.15 tras lo cual se TAC cuerpo completo para evaluar respuesta\nSe objetiva quimiosensiblidad tras 20 ciclo de QT alcanzando 2ª RC.\nPaciente con muy BEG. Mejoría progresiva de la hemiparesia hemicuerpo derecho. Ya se poner de pie y ha iniciado deambulación con andador.\nDispone de hermano HLA compatible y se ha propuesto al servicio de Hematología del HU LAa FE para TPH-Alo. El 21/09/2015 el paciente fue valorado deciden esperar a que mejore la situación física del paciente (+-2meses).\nDado que el paciente tiene un alto riesgo de recaída precoz si no se administra tratamiento de QT durante estos meses de espera, se decide iniciar tratamiento con CHOP (1-2 ciclos). No ESHAP porque interferirá más en la recuperación física y porque habrá mayor riesgo de complicaciones infecciosas en paciente que está en RC.\nRecibió el 02/10/2015 el primer CHOP dicional.\n-	Intervenciones quirúrgicas: Implantes dentales', 'Tratamiento actual:\nALOPURINOL 300/ vo/24H   MAGNESIO 53 MG/45 COMPRIMIDOS (NO FINANCIABLE). 2 COMPRIMIDO cada 8 horas durante 10 FLUCONAZOL 100 MG/ 7 CAPSULAS. 1 CAPSULA cada día durante 7 días.     CITALOPRAM BEXAL 20MG 56 COMPRIMIDOS RECUBIERTOS PELICULA EFG. 1 COMPRIMIDO cada día CIPROFLOXACINO 500 MG/ 14 COMPRIMIDOS. 1 COMPRIMIDO cada 12 horas durante 7 días. MYCOSTATIN ENJUAGUES.                                                                                                                    MOVICOL 1sobre cada 8,12 o 24h según precise.\n-Situación basal: Vive con su mujer. Vida cama- sillón. Dependiente para las actividades básicas diarias.\nEnfermedad actual\nVarón de 64 años que acude por manchado de sangre de región perianal y tumoración, ya presente previamente, de mala evolución.\nNo dolor abdominal.\nNo fiebre ni sensación distérmica (con tratamiento con Corticoides por esquema CHOP hasta el pasado 09/10/15).\nActualmente dia +10 post (10 CHOP)\nNo nauses ni vómitos\nHábito intestinal normal. No síndrome miccional.', 'TA 106/71 mmHg FC 115 lpm SatO2 98%\nBEG. Consciente y orientado. Palidez mucocutanea.\nACP: rítmico sin soplos. MVC sin ruidos patológicas\nAbdomen byd sin ptos dolorosos, no irritación peritoneal. No masas ni visceromegalias MMII sin edemas.\nTacto rectal: esfínter normal con hemorroide exterma no complicada. Dedil mancahado de heces normales Absceso periesfinter con salida de contenido serohemático.\nCIRUGÍA (Dra. Paya):\n“Paciente de 64 años que acude a urgencias manchado de sangre de la región perianal de dos días de evolución asociado a discreta proctalgia. Refiere sensación de tumoración en la región en los días previos. No refiere rectorragia, ni fiebre.\nEF: BEG\nEn región perianal a las 5 horas en PG se observa pequeña tumoración con solución de continuidad en su superficie que supura de forma espontánea material hemático sucio.\nSe observa marisca anal a las 6 horas en PG. Al tacto rectal no se tracta abombamiento.\nAnalítica:\nGlucosa: 164mg/dl; Urea:37 mg/dl Creatina: 0.58 mg/dl; Alt(gpt):11 ui/l; Ck total:18 ui/l; Proteínas totales:5.5 g/dl; Albúmina: 3.3 g/dl; Calcio:8.4mg/dl; Sodio:133meq/l; Potasio:4.1 meq/l; Cloro:97 meq/l;Plaquetas:Plaquetas:9 x10e9/l; Tiempo de protombina:13 s; Índice de quick:77 %; l.n.r.:1.19inr; T.t.p.s:54s; T.t.p.r.:1.86 ratio; Hemoglobina:8.8 g/dl; Hematocrito:26.3%; Vcm:98.4 fl; Hcm:32.7 pg; Chcm:33.2 g/dl; Ade:\n19.4Leucocitos: 0.5x10e9/l; Neutrófilos absolutos:0.2x10e9/l\nAnte el deterioro analítico del paciente se contacta con hematología y se decide ingreso para tratamiento médico. En función de la evalución se valorará tratamiento quirúrgico', 'Recuerde que tiene usted la/s siguientes/s cita/s:\nEl lunes 30 de Noviembre de 2015 a las 12:12 REHABILITACIÓN\nSE PROGRAMA VISITA SEGUIMIENTO CIRUGIA GENERAL', 'Quimioterapia', NULL, 'CIRUGÍA (Dra. Paya)', NULL, NULL, 'Recuerde que tiene usted la/s siguientes/s cita/s:\nEl lunes 30 de Noviembre de 2015 a las 12:12 REHABILITACIÓN\nSE PROGRAMA VISITA SEGUIMIENTO CIRUGIA GENERAL'),
(61, '2015-11-02 00:00:00', '2015-10-29 00:00:00', '2015-11-02 00:00:00', NULL, NULL, NULL, 68, 47, NULL, 1, 11, 6, NULL, 5, 1, 1, 22, 'Hombre de 17 años de edad que ingresa por ENF, COMUN procedente de SERVICIO DEL PROPIO CENTRO - URGENCIAS MEDICAS \nCirugía electiva: neumotórax de repetición espontaneo derecho', 'No ram. \nAP: Neumotórax en Marzo de 2015, \nAQ: Drenaje neumotórax. .', 'Paciente de sexo Masculino de 17 años que acude a urgencias por presentar dolor en hemitórax derecho. Se realiza radiografía de tórax que presenta neumotórax derecho de la misma magnitud que en el momento del alta.', 'Estable', 'Rx tórax: neumotórax apical derecho sin cambios respecto a los previos \nEvolución / Evolución: el paciente en el momento del alta se encuentra con dolor leve, eupneico en reposo y afebril.', 'NEUMOTORAX DERECHO ESPONTANEO RECIDIVANTE', NULL, 'RESECCIÓN BLEBS APICALES LSD POR VIDEO TORACOSCOPIA', 'REPOSO RELATIVO. PUEDE DAR PASEOS. 2. En caso de recrudecimiento de síntomas debe acudir a Urgencias para nueva valoración.', 'Paracetamol 500 mg/8 horas si dolor', 'Reposo relativo. Actividad física progresiva \nControl por médico de cabecera \nRevisión en Consultas de Cir torácica (n°44) el 16/12/15 a las 17:00 horas con Rx de control realizada ese día'),
(63, '2015-03-08 00:00:00', '2015-03-05 00:00:00', '2015-03-08 00:00:00', NULL, NULL, NULL, 44, 77, NULL, 4, 12, 6, NULL, 5, 5, 1, 22, 'NEUMOTORAX ESPONTANEO', 'NO RAM No antecedentes médicos ni quirúrgicos no hábitos tóxicos. No medicación habitual.', 'Hombre de 16 años de edad, presenta desde hace 4 días dolor pleuritico en hemotórax derecho, sin sensación de disnea acude a MAP quien solicita Rx de tórax con evidencia de neumotorax derecho y remite a urgencias para valoración.', 'Toma de constantes en sala de traje a las 20:52 del 04/03/2015:\nTemperatura (°C): 36,20000080. \nFrecuencia cardiaca (lat/min): 6002 (%): 100 \nToma de constantes en sala de traje a las 20:54 del 04/03/2015 \nTensión arterial (mmHg)\n103/45 COC BEG normoperfundido y normohidratado \nACritmico sin soplos \nCil 40120 eu eleco \nAP MVC abolido en ápex y base de hemjtórax derecho. \nResto anodino la base no I apir', 'Continuar EL ESTADO DE REPOSO', 'NEUMOTÓRAX ESPONTÁNEO PRIMARIO COMPLETO DERECHO', NULL, 'RX TORAX: neumotorax derecho \nshax, g.no hay aire ni eu \nMonocitos \nHEMOGRAMA Leucocitos 7,69 x10^9/L Neutrófilos (%) 45,30 % Linfocitos (%) 43,80 % (%) 8,70 % Hemoglobina 12,9 g/dL Hematocrito 39 % Plaquetas 225 X 10^9/L. \nBIOQUÍMICA GENERAL Glucosa 87 mg/dl Urea 29 mg/dL Creatinina 0,64 mg/dL Sodio 141 mmol/L Potasio 4,0 mmol/L Cloro 102 mmol/L Proteina C Reactiva (PCR) 6,0 mg/L \nHEMOSTASIA \nTP 15,4 segundos Ratio Tiempo de Protrombina 1.15 \nindice de Quick 75 % \nINR 1,20 \n***EN SALA*** RX CONTROL: Mediastino de tamaño normal. No se observa nódulos, masas ni áreas de consolidación. No se observa derrame pleural. No se identifica neumotorax. EVOLUCIÓ CLÍNICA / EVOLUCIÓN CLÍNICA', 'SI DOLOR PERSISTENTE O INTENSO, acudir al centro', 'Analgésico si dolor', 'Reposo relativo durante 48 horas,'),
(64, NULL, '2008-10-01 00:00:00', '2008-10-30 00:00:00', 0, NULL, NULL, 68, 15, NULL, 27, 5, 1, NULL, 6, 1, 1, 18, 'Hombre de 52 años de edad que ingresa por neumonía en VIH + procedente de urgencias.', 'No alergias medicamentosas conocidas. No DM. No HTA. No DM.No DL.Ex - ADVP sin tratamiento sustitutivo con metadona.Fumador de 5 cig/día.Bebedor crónico 2- 3 cervezas al día.Infección VIH conocida desde 1995.Primera visita 26/06/00 en consultas externas en U.E.infecciosas. Tomo durante 1 año y medio combivir + Nelfinavir.En tratamiento actualmente con kivexa y sustiva. infección crónica  VHC sin descompensaciones hasta la actualidad.\nIngreso en Traumatología en junio 2002 por fractura de ? proximal cúbito y radio que se intervino quirúrgicamente.Reingreso para nueva intervención en mayo 2003 por secuelas de dicha fractura. Ingreso en neurología en mayo de 2006 por mielopatía subaguda  a estudio.Recibió tratamiento con bolus de metilprednisolona y se diagnostica de mielitis transversa en VIH.Reingreso en septiembre de 2006 y en febrero de 2007 por empeoramiento de la mielitis, recibió un nuevo bolus de corticoides con mejoría parcial posteriormente empeoramiento progresivo hasta paraplejia por lo que requiere silla de ruedas. Ingreso en la UEI en junio de 2007 por varicela y en septiembre de 2007 por TVP y dado su problema social al alta se remite a hospital de larga duración Dr.Moliner siendo dado de alta 5 meses después y en marzo de 2008 ingresa en la UCI por shock séptico de origen urinario, que evoluciona bien con tratamiento antibiótico pero se comprueba vejiga neurógena secundaria a la mielitis por la que de acuerdo con urología se retira la sonda vesical permanente realizando autosondaje para vaciar la vejiga.Se da el alta médica el 09/04/2008 pero por problema social ha permanecido en el hospital hasta el 24 de septiembre de 2008 *Tratamiento actual: seropram 1 comp./día, trankimazin retard. 0,5 mg:\n 1 comp./12h.Lioresal,neurontin,orfidal*.\nIntervenciones quirúrgicas: brazo derecho en 2 ocasiones.Esplenectomizado.Exéresis ½ riñón izquierdo realizada en Estados Unidos.', 'Acude a urgencias por malestar general,sensación distérmica no termometrada,tos, expectoración y dolor torácico de tipo pleurítico de unos dos días de evolución. No refiere disnea.No nausias ni vomitos ni diarrea,lleva sonda vesical permanente,no se objetiva orina purulenta.En Urgencias se objetiva fiebre de 39ºC y ante el hallazgo radiológico compatible con neumonía se decide ingreso.', 'Regular estado general, TA:90/50 mmHg, Tax: 39ºC, Fc 100 lpm, Sat 02(Fi02; 0,21): 96% cuello: no ingurgitación yugular.AC:tonos rítmicos, sin soplos ni roces. AP: Hipofonesis en base izquierda, algún roncus aislado en hemitórax derecho, no se auscultan crepitantes ni sibilantes. Abdomen: blando, depresible. Ruidos hidroaéreos conservados no metálicos. No masas ni megalias. No dolor a la palpación,no peritonismo.Edemas tibiomaleolares con fóvea bilaterales,no signos de trombosis venosa profunda en miembros inferiores.Pulsos periféricos simétricos y palpables.Examen neurológico: consciente, orientado. Lenguaje normal.Pupilas isocóricas normorreactivas-Pares craneales normales. Paraplejia desde nivel D6-D7 con fuerza 2+/5 en extremidades inferiores, sensibilidad disminuida en EEII. Reflejos osteotendinosos vivos. No rigidez de nuca ni signos meníngeos.', 'DERRAME PLEURAL. CONDENSACIÓN EN HEMITÓRAX IZQUIERDO: Se ingresa al paciente y se instaura tratamiento antibiótico de amplio espectro con Imipenem y fluidoterapia con buena evolución y desaparición de la fiebre con leve mejoría del dolor pleurítico y la tos, pero la evolución radiológica no es buena de forma que el dia 10/10 se realiza TAC torácico que demuestra derrame pleural masivo que procede desplazamiento de mediastino por lo que se consulta con Neumologia y se decide realizar toracocentesis e implantación de tubo de drenaje durante 48h retirándose el dia 13/10 al comprobar que no seguía drenando y el líquido pleural no cumplia criterios de empiema. Tras 15 días de tratamiento con Imipenem se retira y se pauta Levofloxacino con buena tolerancia y sin reaparición de la fiebre. El dia 23/10 ante la persistencia del derrame se realiza nueva toracocentesis diagnóstica que confirma que se trata de un exudado pero sin crecimiento de gérmenes ni detección de células malignas. La clínica respiratoria ha mejorado claramente y el dia 29/10 se decide retirar antibióticos sin evidenciar empeoramiento clínico ni radiológico. 2 INFECCIÓN VIH: El paciente refiere que desde hace unos 5-6 meses no toma tratamiento antirretroviral. En las analíticas se comprueba cifra de CD4; 384 cel/ml 16% el dia 03/10 y 527 cel/ml 17% el dia 15/10. El paciente ha expresado su deseo de retomar el tratamiento antirretroviral por lo que se decide remitir a consultas externas 3-INFECCIÓN VHC: durante el ingreso no ha presentado clínica de descompensación de su hepatopatía crónica. Las cifras de transaminasas se han mantenido en niveles prácticamente normales: GOT: 59 UI/L, GPT:21 UI/L. 4- MIELITIS DE REPETICIÓN: el paciente refiere notar leve mejoría en la fuerza distal en EEll con posibilidad para movimientos de flexo-extensión voluntaria en ambos pies. Se solicitó valoración por Neurología que refiere que debe tratarse con Vit B y acudir al centro de Salud de Seteria Il para rehabilitación. Con relación a su problema de vejiga neurógena, durante el ingreso ha permanecido con sonda vesical permanente, pero se retira al alta pautandose nuevamente autosondajes extremando las medidas higiénicas y se le da tratamiento antibiótico profiláctico. 5-EX ADVP. ADICCIÓN A BENZODIACEPINAS: durante el ingreso se han pautado dosis bajas de Alprazolam. No ha presentado ningún problema de tipo ansioso ni ha requerido aumento de dosis. 6- Problema social: durante su ingreso se ha consultado de nuevo con trabajo social que sigue intentando encontrar algún recurso disponible que sea adecuado. Se le ha proporcionado al paciente información de posibles recursos para que el realice las gestiones necesarias para intentar ingreso en los mismos.', 'NEUMONÍA BILOBAR IZQUIERDA', 'Derrame pleural metaneumónico Infección VIH Infección VHC Mielitis de repetición. Paraplejia secundaria y vejiga neurógena con necesidad de autosondaje vesical.', 'TORACOCENTESIS DIAGNÓSTICA Y TERAPÉUTICA', NULL, NULL, NULL),
(65, NULL, '2019-12-12 00:00:00', '2019-12-27 00:00:00', NULL, NULL, NULL, 1, 105, NULL, 1, 1, 1, NULL, 1, 1, 1, 37, 'Varón de 67 de edad. Cuadro de tos con expectoración verdosa de dos semanas de evolución, Sensación febril no termometrada. Disnea progresiva en los últimos días.', 'DMNIb, EPOC. No alergias medicamentosas conocidas.', NULL, 'Exploración clínica Consciente y orientado, buen estado general, normohidratado y normocoloreado, apirétiq ligera disnea de reposo. hemodinámicamente estable. Auscultación CO: Tonos rítmicos. Roncus y sibilantes espiratorios diseminados.\nExploraciones complementarias: Rx. Tórax: Aumento de marcas. EKG: Ritmo sinusal. Evolución: Favorable. Buena respuesta al tratamiento broncodilatador y corticoideo quedando el paciente eupneico. Control de las glucemias aumentando la dosis del ADOI.', 'Función cognitiva: Conservada.\nFunción perceptiva: Conservada -índice de Barthel: 100.\nSituación sociofamiliar: Normal. Buen apoyo familiar.', 'EPOC', 'Reagudización.\nSobreinfección respiratoria.', NULL, 'Tratamiento: Theodur 200, 1 comp.1 12 horas. Dieta diabética. Ingesta adecuada de líquidos.\nbaonil 1-1-1. Control de glucemias capilares hasta ajustar dosis en relación con la corticoterapia corta. Zamene 30, 1 comp. en el desayuno durante tres días. Disminuir posteriormente % de comp. cada tres días hasta suspender. Zantac 300, 1 comp. en la cena. Ventolin 21NHI 6 horas y Atrovent 4 INH/ 6 horas, ambas en cámara de Aerochamber. Augmentine 875, 1 comp 8 horas durante una semana. Se remite a Su Médico de Cabecera y al Neumólogo de Zona.', NULL, NULL),
(66, NULL, '2010-10-28 00:00:00', '2010-07-11 00:00:00', 0, NULL, NULL, 42, 74, NULL, 1, 7, 1, NULL, 8, 1, 1, 24, 'Recién nacido varón que ingresa desde quirófano de urgencias por distrés respiratorio y mala adaptación neonatal.', NULL, 'Procede de la primeración (G1 A0 V1) de una madre sana de 19 años. FUR 7/01/2010. Grupo sangineo B positivo. Embarazo controlado con ecografías normales. Serologias negativas (VHB, VHC, VIH, toxoplasma) excepto inmune a rubeola. Test de O´Sullivan normal. Screening de SBG rectal/vaginal negativo.\nA las 40 semanas + 2 días acude a urgencias por algias y metrorragia. Bolsa integra con LA claro y RCTG normal en ese momento. Se deja ingresada y tras doce horas, se decide inducción por falta de progresión. Se realiza RCTG con frecuentes bradicardias patológicas. Se observa líquido amniótico meconial-hemorragico, por lo que se decide realizar cesarea urgente bajo anestesia general.\nNace recién nacido varon hipotónico, en apnea y cianótico. Se aspiran escasas secreciones meconiales-hemorragicas en glotis y se aproxima fuente de O2 con inicio de escaso esfuerzo respiratorio persiste hipotonía marcada y escasa expansión toraxica. Llama la atención distención abdominal importante. Apgar 4/7. pH cordón 7.21. Ante mala adaptación neonatal se decide ingreso en UCI-neonatal.', 'P: 3200G (p50). L:50cm (p50-75). PC:34.5cm (p75). Tª 35?C, FC 122 lpm, TA 51/24 mmhg. Regular aspecto general, acorde a la edad gestacional. Cianosis perioral, regular perfusión distal. No malformaciones externas. Cráneo normoconformado. FANT 1x2 cm. Clavículas integras. Auscultación cardíaca:  tonos puros y rítmicos. Pulsos periféricos normales. Taquipnea y tiraje intercostal marcado junto con escasa expansión torácica. Abdomen: blando y depresible, no masas ni megalias. Cordón: 2A  1V. Paladar íntegro. Ano perforado. Genitales normoconformados de niño. Testes en bolsa. Ortolani y Barlow: negativos. Reflejos arcaicos presentes y simétricos.\n\nPRUEBAS COMPLEMENTARIAS\n-	Grupo sanguíneo: 0, RH +, Coombs directo negativo.\n-	Hemograma y química (tras nacimiento): Leucocitos 18.800 (Neutrófilos 48%, Linfocitos 42%), Hb 14,3g/dl, Hto 47%, plaquetas 178.000/mcl. Sodio 137, potasio 3.7, glucemia 48, creatinina 1.18. GOT/GPT 1233/500. CK-MB 22.54. Troponina 0.073. PCR 2.2.\n-	Coagulación (tras nacimiento): muestra alteración en vía intrínseca y extrínseca.\n-	EAB (2 h de vida): pH 7.29, Pco2 40 mmHg, HCO3 19.2 mmol/L, Exceso de base -6.4 mmol/l, Anion GAP 18 mmol/L, K 3.5 y resto iones normales. Glucemia 38 mg/dL. Lactato 13mmol/L.\n-	Hemocultivo, cultivo exudado ótico y de jugo gástrico: negativos.\n\n-Ecografia transfontanelar (29/10/10): se visualizan áreas hiperecoicas sobre  todo a nivel cortical, identificando a sí mismo, flujos de baja resistencia, en relación con hiperaflujo, como respuesta a isquemia-anoxia. Ventrículos centrados de tamaño normal. No malformaciones ni imágenes de hemorragia.\n-RMN cerebral (2/11/10): Alteración morfológica del cuarto ventrículo y fosa posterior, compatible con variante de Dandy-walker. Alteración de señal con resección de difusión en topografía de cuerpo calloso (predominio en esplenio) así como sustancia blanca periventricular y subcortical adyacente a los atrios ventriculares. Los hallazgos descritos son compatibles con infarto de características subagudas y necrosis laminar  cortical occipital y, en menor medida, parietotemporal bilateral. Se evidencia también signos de necrosis laminar cortical (Restos hemáticos) en parénquima de hemisferios cerebelosos. Sin otras alteraciones significativas.\n-	Electroencefalograma (28/10/10): trazado dentro de los límites normales para su edad. \n-	Ecografía tranfontanelar (5-11-10): Sólo llama la atención la persistencia d elo que parece una cisterna magna grande.\n-	Ecografía abdominal (29-10-10): Se objetiva trombosis de la rama izquierda de la porta, lo que podría estar en relación con la cateterización de la vena umbilical.\n-	Ecografía abdominal (5/11/10): No apreciamos alteraciones renales ni hepáticas.', NULL, 'Encefalopatía hipóxico isquémica', NULL, NULL, NULL, NULL, NULL),
(67, NULL, '2014-08-29 00:00:00', '2014-09-03 00:00:00', 0, NULL, NULL, 37, 62, NULL, 3, 7, 1, NULL, 9, 1, 1, 41, 'Mujer de 86 años, remitida a urgencias con imposibilidad por bajo nivel de consciencia. Los familiares refieren debilidad de MMII de 24 horas de evolución con incapacidad para la bipedestación.\nDiagnosticada hace 3 días de ITU e ICC \n\nSegún familiares buena Diuresis, no semiología respiración no ortopnea', 'No RAM conocidas, HTA, FA, ICC.\nDM tipo 2\nAnemia crónica\nCirugía de cataratas\nTratamiento habitual de; Emconcor 5, Sintrom, Captopril, Insulina y Ferogradument.', 'En tratamiento actualmente de; Augmentine, Seguril y Paracetamol', 'Buen estado nutricional, 26 rpm con aumento del trabajo respiratorio, cy c : IVY,\n AC: tonos arrítmicos a 120 lpm, \nAP: crepitantes en ambas bases del predominio izquierdo\nAbd: globuloso, hepatomegalia de 5 cm \nEEII: edemas blandos\nMúltiples hematomas en todos los territorios.\nAnisocoria: pupila izquierda excéntrica y algo más midriática.\nExploración Neurológica: no signos meníngeos.', 'La paciente ingreso con síndrome séptico, fibrilación auricular rápida a 150 l/min e insuficiencia renal grave.\nHa precisado dosis altas de diuréticos y albúmina para la disminución de los edemas, secundariamente hiponadremia que ha indicado restricción hídrica a 1 L/dia. \nAl alta: ura 172, creatinina 2,30, Na 134, K 5.1 , Hb 9.2, leucocitos 4600, plaquetas 92000. Al alta rítmica a 92 l/min.', 'BACTERIEMIA POR STAPHYLOCOCCUS AUREUS, SEPSIS GRAVE.', 'Infección urinaria por K.Pneumoniae, insuficiencia renal crónica agudizada.\nInsuficiencia cardiaca, hepatopatía crónica VHC+ , descoagulada, Neumonía LII , Hipertensión arterial, Diabetes Mellitus tipo, Candiduria.', 'Analítica: Hb: 12, Plaquetas:76000 , Leucocitos: 9200, Ne 87,8%, Coagulación: muestra no coagulable.\nUrea 209 , Cr 4.10 , Proteínas totales 604 ,  Na 134 , K 5.5 , CK 384 , PCR 11.63 , Proteínas totales 7.0 , Albúmina 1.9 , hipergammaglobulinemia policional , GOT 51 , GPT 69 , bilirrubina total 1.25 , fosfatasa alclaina 110 , GGT 86 , seroconversión para VHB con HBsag negativo , Ac anti VHV positivo , Hormonas tiroideas normales.\nGasometria venosa: Ph 7.41, HCO3 19, Sp02 89%, Lactato 1.69.\nOrina: 20-25 leucos/campos, Urinocultivo Klebsiella pneumoniae sensible a betalactámicos y quinolonas.\nHemocultivo: Staphylococcus  aureus meticilin sensible.\nOrina; 20-25 leucos por campo.\n\nECG: AC * FA, BCRDHH, \nECOCARDIOGRAFIA: Insuficiencia aórtica ligera, VI de volúmenes y función global sistólica conservada, sin alteraciones de contractilidad en reposo, ligera dilatación aurícula izquierda, insuficiencia tricúspide ligera-moderada asociada a HTP ligera (PAP sist 45 mm Hg)\nRX TÓRAX: cardiomegalia, aumento de densidad en base y borramiento silueta cardiaca izquierda-\nECOGRAFIA ABDOMINAL: hipertrofia LHI y caudado, bordes poliglobulados compatible con hepatopatía crónica, no LOEs , eje espienoportal normal, pero con flujos disminuidos.\nNo circulación coletral\nModerada ascitis\nVía biliar normal\nNo esplenomegalia.', 'Dieta diabética \nAgua máximo l Litro al día', 'Trangorex  1 comprimido al día cada 12 h. durante 7 días\nContinuar con 1 comprimido al día de (control de hormonas tiroideas en 1 mes), \nSeguril 1 comprimido en el desayuno y 1 comprimido en la comida.\nSintrom 1mg al día, excepto el domingo que se tomará 2mg. Control el jueves próximo.\nDiflucan 100mg al día, durante 5 días.\nTavanic 500mg  cada 2 días durante 5 días.\nDuphalac un sobre cada 8h .\nResto de su tratamiento habitual', NULL),
(68, NULL, '2015-06-21 00:00:00', '2015-07-18 00:00:00', 0, NULL, NULL, 28, 114, NULL, 4, 4, 1, NULL, 6, 1, 2, 41, 'Hombre de 64 años de edad que ingresa por enfermedad común procedente del servicio \nde propio centro.', 'Antecedentes\n-	No RAM conocidas\n-	No hábitos tóxicos\n-	Hta\n-	No DM\n-	No DL\n\nIntervenciones quirúrgicas : implantes dentales\n\nAntecedentes médicos\n\nLinfoma plasmablástico estadio IV-A  diagnosticado en Agosto de 2014 ( El diagnostico presenta varias masas paravertebrales de T8 a T12-L1, nódulos pulmonares, masas retroperitoneales)\n\nRecibió tratamiento con R-Hyper CAVD x 4 ciclos entrando en remisión completa. Se consolidó con TASPE en Enero de 2015 (Día 0 : 14/01/2015).\nPET/TC de control a los 3 meses: RC metabólica.\n\nSituación basal \nVive con su mujer\nIndependiente para las ABVD\nTrabaja como camionero', 'Varón de 64 años que acude por debilidad rn MID desde hace 48 h , refiere que hoy ya nota que la izquierda tampoco responde. Refiere sensibilidad conservada pero pérdida de fuerza progresiva, con fallo de miembros hasta llegar a la paresia.\nNiega incontinencia de esfínteres o retención urinaria.\nAdemás refiere sensación de hormigueo en dicho miembro desde hace dos semanas.\nRefiere que desde hace 15 días presenta cervicalgia y dorsalgia. Dolores óseos a nivel cérvico-dorsal, escápulas y costillas.\nSin fiebre ni sensación distérmica. Sin otra sintomatología asociada.', NULL, 'Ingresa por comprensión medular en el contexto de alta sospecha de recaída por linfoma. Al ingreso ante el compromiso neurológico se inicia tratamiento con Rt URGENTE y tratamiento con dexametasona iv. Recibe RT DEL 22/06/2015  al 26/06/2015 sobre lesiones extranodales que provocan comprensión medular se realiza el 24/06/2015 punción de lesión a nivel de L1-L2 sin complicaciones inmediatas pero sin rendimiento diagnóstico.\nTras informar al paciente y tras objetivar la progresión del déficit neurológico el 24/06/2015 se administra un ciclo de QT tipo CHOP que se administra de forma concomitante con la RT . no se objetiva mejoría de la exploración neurológica hasta el 28/06/2015 fecha a partir de la cual inicia recuperación del déficit neurológico en MMSS y recupera sensibilidad en MMII izquierdo, no mejoría del déficit motor en MMII izquierdo ya presenta al ingreso( plejia MMII izquierdo).\n	\nIngreso sin complicaciones infecciosas. Recupera PNM el 06/07/2015 pero se decide demorar siguiente ciclo de QT (1er ESHAP) hasta recuperación cifras de plaquetas. Dado que no se consigue la recuperación de plaquetas demorándose la administración del siguiente ciclo de QT se decide el 13/07/2015 iniciar el 1er ESHAP con soporte transfusional de plaquetas(33.000 plaquetas día 1 QT)+ neulasta el día + 1 (19/07/2015) \nDurante el ingreso el paciente ha iniciado rehabilitación que continuara de forma ambulatoria.\nDada la estabilidad clínica y tras finalizar QT  se decide el alta hospitalaria y seguimiento por hospital de dia.\nDurante el ingreso se realiza Estudio HLA del paciente y de 4 de sus hermanos.', 'LINFOMA  PLASMABLASTICO  EN  1ª  RECAIDA  PRECOZ  POST  TASPE', 'COMPRENSIÓN MEDULAR\nRADIOTERAPIA LOCAL\n1 CICLO QUIMIOTERAPIA CHOP\n1 CICLO QUIMIOTERAPIA ESHAP', NULL, NULL, 'ALOOPURINOL 300 / vo / 24h	MAGNESIO 53mg / 45 comprimidos (no financiable) 2 comprimidos cada 8 h durante 10 días.	\nFLUCONAZOL 100mg / 7 capsulas 1 capsula cada día durante 7 días.	XKETOPROFENO 25mg / 20 capsulas duras 1 capsula cada 8 h ( si hay dolor)\nCITALOPRAM BEXAL 20 mg 56 comprimidos recubiertos película afg 1 comprimido cada día.,)	CIPROFLOXACINO 500 mg / 14 comprimidos 1 comprimido cada 12h durante 7 días.\nOMEPRAZOL 20 mg/ 28 capsulas 1 capsula al día.', 'Acudirá al hospital de día de HEMATOLOGIA ( el próximo 24 de julio a las 8.30 para hacer analítica, visita y soporte Tx.\n\nSiguiente cita:\nJueves 30 de julio de 2015 a kas 10.00h : ubicada en local 1 de rehabilitación del hospital.\n\nSi fiebre debe acudir a urgencias con informes médicos y avisar al HEMATOLOGO.');
